if ctld then
    env.info("DSMC: ctld_c: another ctld version is running. halting process")
    return
end

if not DSMC_MainVersion then
    env.info("DSMC ctld_c: DSMC is required to allow this code to be run correctly")
    return
end

env.info("DSMC's CTLD, version 2022.04.05: loading code... ")

ctld_c = {} 

-- ************************************************************************
-- *********************  USER CONFIGURATION VARIABLES ********************
-- ************************************************************************

-- DEBUG MODE: must be true to enable verbose logging and error checkHoverStatus
local debugProcessDetail        = false

-- Generic variables
ctld_c.soldierWeight            = 110 -- single soldier weight, added by Chromium
ctld_c.disableAllSmoke          = false -- if true, all smoke is diabled at pickup and drop off zones regardless of settings below. Leave false to respect settings below
ctld_c.enableSmokeDrop          = true -- if false, helis and c-130 will not be able to drop smoke

-- Troops transport variables
ctld_c.maxExtractDistance       = 125 -- max distance from vehicle to troops to allow a group extraction
ctld_c.maximumDistanceLogistic  = 300 -- max distance from vehicle to logistics to allow a loading or spawning operation 
ctld_c.maximumSearchDistance    = 4000 -- max distance for troops to search for enemy
ctld_c.maximumMoveDistance      = 100 -- max distance for troops to move from drop point if no enemy is nearby
ctld_c.minimumDeployDistance    = 1000 -- minimum distance from a friendly pickup zone where you can deploy a crate. DSMC: also work reversed for movers! it became the maximum distance from warehouse where you can unpack movers crates
ctld_c.numberOfTroops           = 10 -- default number of troops to load on a transport heli or C-130. this can be ovverride using the loadlimits table
ctld_c.enableFastRopeInsertion  = true -- allows you to drop troops by fast rope
ctld_c.fastRopeMaximumHeight    = 18.28 -- in meters which is 60 ft max fast rope (not rappell) safe height


-- Crates variables
ctld_c.enableCrates             = true -- if false, Helis will not be able to spawn or unpack crates
ctld_c.slingLoad                = true -- if false, crates can be used WITHOUT slingloading, by hovering above the crate, simulating slingloading but not the weight...
ctld_c.unpackRestriction        = true -- if false, you can unpack in logistic zone
ctld_c.forceCrateToBeMoved      = true -- a crate must be picked up at least once and moved before it can be unpacked. Helps to reduce crate spam
ctld_c.crateOpsDistance         = 100 -- max distance in meters from unit to crates to allow drop & loading operation, DSMC
ctld_c.crateReductionFactor     = 1.5 -- in this version the crates required to built a vehicle depends from the life points. the more you increase this value, the lesser crates are required
ctld_c.crateLargeToSmallRatio   = 3 -- this variable define how many small crates equals to large crates. "3" means that 3 small crates equals to 1 large crates.
ctld_c.crateWaitTime            = 5 -- time in seconds to wait before you can spawn another crate
ctld_c.spawnCrateOffset         = 30 -- meters of distance of the spawned crate. ctld_c default = 30, but 20 or less may help on carriers 
ctld_c.unpackCrateDistance      = 200 -- distance in meters between the heli and the nearest crate to allow an "unpack" action. It's also used to determinee if you moved the crate at least once after the crate creation.
ctld_c.unpackTemplateDistance   = 750 -- distance in meters between the crates to be identified as ok for a template (else, you will need to group them more). This also apply for FOB crates

-- FOB crates
ctld_c.enabledFOBBuilding       = true 
ctld_c.cratesRequiredForFOB     = 1  -- big crates parameter. Check ctld_c.crateLargeToSmallRatio to understand the big to small ratio
ctld_c.buildTimeFOB             = 240 --time in seconds for the FOB to be built
ctld_c.troopPickupAtFOB         = true -- if true, troops can also be picked up at a created FOB

-- Repair crates
ctld_c.repairCrateModel         = "container_cargo"
ctld_c.repairDelay              = 20 -- minutes since a repair is called to be completed.

-- Airlift crates variables
ctld_c.enableAirliftcrates      = true
ctld_c.upscaleResupplyFactor    = 10 -- crate weight / warehouse resupply weight factor. if it's 10, means that 1 ton fuel tank goes to 10 tons fuel resupply.

-- SAM crates
ctld_c.enableSAMcrates          = true
ctld_c.longRangeSamCrates       = true
ctld_c.SAM_site_limit           = 50

-- JTAC crates
ctld_c.enableJTACcrates         = true
ctld_c.enableJTACSmoke          = true
ctld_c.JTAC_LIMIT_RED           = 10 -- max number of JTAC Crates for the RED Side
ctld_c.JTAC_LIMIT_BLUE          = 10 -- max number of JTAC Crates for the BLUE Side
ctld_c.laser_codes              = { 1511, 1113, 1688} -- Put here the available laser codes. The first value is the default for RED and the second for BLUE
ctld_c.JTAC_maxDistance         = 10000 -- How far a JTAC can "see" in meters (with Line of Sight)

-- Beacons
ctld_c.radioSound               = "beacon.ogg" -- the name of the sound file to use for the FOB radio beacons. If this isnt added to the mission BEACONS WONT WORK!
ctld_c.radioSoundFC3            = "beaconsilent.ogg" -- name of the second silent radio file, used so FC3 aircraft dont hear ALL the beacon noises... :)
ctld_c.deployedBeaconBattery    = 240 -- the battery on deployed beacons will last for this number minutes before needing to be re-deployed
ctld_c.enabledRadioBeaconDrop   = true -- if its set to false then beacons cannot be dropped by units
ctld_c.beaconMinFreq            = 200000 --108000000 -- beware, changing this could affect user experience due to aircraft radio limitations
ctld_c.beaconMaxFreq            = 1250000 --115000000 -- beware, changing this could affect user experience due to aircraft radio limitations
ctld_c.beaconRefreshPeriod      = 65 -- IMPORTANT - Set this time (secs) to a bit longer than your max beacon.ogg or beaconsilent.ogg run duration.
                                     -- The ADF needle will only point during the audible period, and a shorter period here will overlap and cause issues.



