-- Continuous Trigger Function
-- Causes an AI unit with the specified name to unload troops / vehicles when
-- an enemy is detected within a specified distance
-- The enemy must have Line or Sight to the unit to be detected
function ctld_c.unloadInProximityToEnemy(_unitName,_distance)

    local _unit = ctld_c.getTransportUnit(_unitName)

    if _unit ~= nil and _unit:getPlayerName() == nil then

        -- no player name means AI!
        -- the findNearest visible enemy you'd want to modify as it'll find enemies quite far away
        -- limited by  ctld_c.JTAC_maxDistance
        local _nearestEnemy = ctld_c.findNearestVisibleEnemy(_unit,"all",_distance)

        if _nearestEnemy ~= nil then

            if ctld_c.troopsOnboard(_unit, true) then
                ctld_c.deployTroops(_unit, true)
                return true
            end

            if ctld_c.unitCanCarryVehicles(_unit) and ctld_c.troopsOnboard(_unit, false) then
                ctld_c.deployTroops(_unit, false)
                return true
            end
        end
    end

    return false

end



-- Unit will unload any units onboard if the unit is on the ground
-- when this function is called
function ctld_c.unloadTransport(_unitName)

    local _unit = ctld_c.getTransportUnit(_unitName)

    if _unit ~= nil  then

        if ctld_c.troopsOnboard(_unit, true) then
            ctld_c.unloadMultiTroops({_unitName,true})
        end

        if ctld_c.unitCanCarryVehicles(_unit) and ctld_c.troopsOnboard(_unit, false) then
            ctld_c.unloadTroops({_unitName,false})
        end
    end

end

-- Loads Troops and Vehicles from a zone or picks up nearby troops or vehicles
function ctld_c.loadTransport(_unitName)

    local _unit = ctld_c.getTransportUnit(_unitName)

    if _unit ~= nil  then

        ctld_c.loadTroopsFromZone({ _unitName, true,"",true })

        if ctld_c.unitCanCarryVehicles(_unit)  then
            ctld_c.loadTroopsFromZone({ _unitName, false,"",true })
        end

    end

end

-- adds a callback that will be called for many actions ingame
function ctld_c.addCallback(_callback)

    table.insert(ctld_c.callbacks,_callback)

end

-- Spawns a sling loadable crate at a Trigger Zone
--
-- Weights can be found in the ctld_c.spawnableCrates list
-- e.g. ctld_c.spawnCrateAtZone("red", 500,"triggerzone1") -- spawn a humvee at triggerzone 1 for red side
-- e.g. ctld_c.spawnCrateAtZone("blue", 505,"triggerzone1") -- spawn a tow humvee at triggerzone1 for blue side
--
function ctld_c.spawnCrateAtZone(_side, _weight,_zone)
    local _spawnTrigger = trigger.misc.getZone(_zone) -- trigger to use as reference position

    if _spawnTrigger == nil then
        --trigger.action.outText("ctld_c.lua ERROR: Cant find zone called " .. _zone, 10)
        return
    end

    local _crateType = ctld_c.crateLookupTable[tostring(_weight)]

    if _crateType == nil then
        trigger.action.outText("ctld_c.lua ERROR: Cant find crate with weight " .. _weight, ctld_c.displayMessageTime/2)
        return
    end

    local _country
    if _side == "red" then
        _side = 1
        _country = 0
    else
        _side = 2
        _country = 2
    end

    local _pos2 = { x = _spawnTrigger.point.x, y = _spawnTrigger.point.z }
    local _alt = land.getHeight(_pos2)
    local _point = { x = _pos2.x, y = _alt, z = _pos2.y }

    local _unitId = ctld_c.getNextUnitId()

    local _name = string.format("%s #%i", _crateType.desc, _unitId)

    local _spawnedCrate = ctld_c.spawnCrateStatic(_country, _unitId, _point, _name, _crateType.weight,_side,  _crateType.obj_crate)

end

-- Spawns a sling loadable crate at a Point
--
-- Weights can be found in the ctld_c.spawnableCrates list
-- Points can be made by hand or obtained from a Unit position by Unit.getByName("PilotName"):getPoint()
-- e.g. ctld_c.spawnCrateAtZone("red", 500,{x=1,y=2,z=3}) -- spawn a humvee at triggerzone 1 for red side at a specified point
-- e.g. ctld_c.spawnCrateAtZone("blue", 505,{x=1,y=2,z=3}) -- spawn a tow humvee at triggerzone1 for blue side at a specified point
--
--
function ctld_c.spawnCrateAtPoint(_side, _weight,_point)


    local _crateType = ctld_c.crateLookupTable[tostring(_weight)]

    if _crateType == nil then
        trigger.action.outText("ctld_c.lua ERROR: Cant find crate with weight " .. _weight, ctld_c.displayMessageTime/2)
        return
    end

    local _country
    if _side == "red" then
        _side = 1
        _country = 0
    else
        _side = 2
        _country = 2
    end

    local _unitId = ctld_c.getNextUnitId()

    local _name = string.format("%s #%i", _crateType.desc, _unitId)

    local _spawnedCrate = ctld_c.spawnCrateStatic(_country, _unitId, _point, _name, _crateType.weight,_side, _crateType.obj_crate)
	
	
end

