function ctld_c.getTransportUnit(_unitName, okStatic)
    --env.info(("ctld_c, getTransportUnit _unitName: " ..tostring(_unitName)))
    if _unitName == nil then
        return nil
    end

    local _heli = Unit.getByName(_unitName)

    if _heli ~= nil and _heli:isActive() and _heli:getLife() > 0 then
        --env.info(("ctld_c, getTransportUnit returning _heli: " .. tostring(_unitName)))
        return _heli
    else
        if okStatic == true then
            local _static = StaticObject.getByName(_unitName)
            if _static ~= nil and _static:getLife() > 0 then
                --env.info(("ctld_c, getTransportUnit returning _heli: " .. tostring(_unitName)))
                return _static        
            end
        end
    end

    return nil
end

function ctld_c.spawnCrateStatic(_country, _unitId, _point, _name, _weight, _side, _obj_crate) -- HERE DIFF CRATES

    local _crate
