function ctld_c.spawnCrate(_arguments)
    local _status, _err = pcall(function(_args)

        -- use the cargo weight to guess the type of unit as no way to add description :(

        env.info(("ctld_c, spawnCrate _args1: " .. tostring(_args[1])))

        local _crateType = ctld_c.crateLookupTable[tostring(_args[2])]
        local _heli = ctld_c.getTransportUnit(_args[1])

        --dumpTable("ctld_c._crateType.lua", _crateType)

        if _crateType ~= nil and _heli ~= nil and ctld_c.inAir(_heli) == false then
            
            if _crateType.obj_crate == "fueltank_cargo" then
            
                --local ex1, msg1 = ctld_c.inFactoryZone(_heli)
                local ex2, msg2 = ctld_c.inFuelDepositZone(_heli)
                if ex2 == false then
                
                    ctld_c.displayMessageToGroup(_heli, "Airlift fuel crates can be requested only in proximity to fuel depot\n", ctld_c.displayMessageTime)           
