                        ctld_c.displayMessageToGroup(_heli, tostring(msg2), ctld_c.displayMessageTime)
                    end 
                    return              
                end

            elseif _crateType.obj_crate == "ammo_cargo" then
        
                --local ex1, msg1 = ctld_c.inFactoryZone(_heli)
                local ex2, msg2 = ctld_c.inAmmoDepositZone(_heli)
                if ex2 == false then
                
                    ctld_c.displayMessageToGroup(_heli, "Airlift ammo crates can be requested only in proximity to an ammo depot\n", ctld_c.displayMessageTime)          
                    if msg2 then
                        ctld_c.displayMessageToGroup(_heli, tostring(msg2), ctld_c.displayMessageTime)
                    end
                    return               
                end
                

            elseif _crateType.factory then
				
				if debugProcessDetail then
					env.info("DSMC there's something strange here, no factory crates should exist")
				end		
				
				--[[
                if ctld_c.inFactoryZone(_heli) == false then

                    local ex, msg = ctld_c.inFactoryZone(_heli)

                    ctld_c.displayMessageToGroup(_heli, "Constructable assets' crates can be requested only in proximity to a production site\nand you must deliver the crates nearby a warehouse or logistic zone", ctld_c.displayMessageTime)
                    ctld_c.displayMessageToGroup(_heli, "You need to be close enough to a production site to request constructable crate", ctld_c.displayMessageTime)
                    if msg then
                        ctld_c.displayMessageToGroup(_heli, "Nearest production site is at " .. tostring(msg), ctld_c.displayMessageTime*2)
                    end
                    return
                end
				--]]--
            else
                if ctld_c.inLogisticsZone(_heli) == false then
                    local ex, msg = ctld_c.inLogisticsZone(_heli)

                    ctld_c.displayMessageToGroup(_heli, "You need to be close enough to a logistic site to request crate", ctld_c.displayMessageTime)
                    if msg then
                        ctld_c.displayMessageToGroup(_heli, "Nearest logistic site is at " .. tostring(msg), ctld_c.displayMessageTime*2)
                    end
                    return
                end
            end

            if ctld_c.isJTACUnitType(_crateType.unit) then

                local _limitHit = false

                if _heli:getCoalition() == 1 then

                    if ctld_c.JTAC_LIMIT_RED == 0 then
                        _limitHit = true
                    else
                        ctld_c.JTAC_LIMIT_RED = ctld_c.JTAC_LIMIT_RED - 1
                    end
                else
                    if ctld_c.JTAC_LIMIT_BLUE == 0 then
                        _limitHit = true
                    else
                        ctld_c.JTAC_LIMIT_BLUE = ctld_c.JTAC_LIMIT_BLUE - 1
                    end
                end

                if _limitHit then
                    ctld_c.displayMessageToGroup(_heli, "No more JTAC Crates Left!", ctld_c.displayMessageTime)
                    return
                end
            end

            local _position = _heli:getPosition()

            -- check crate spam
            if _heli:getPlayerName() ~= nil and ctld_c.crateWait[_heli:getPlayerName()] and  ctld_c.crateWait[_heli:getPlayerName()] > timer.getTime() then

                ctld_c.displayMessageToGroup(_heli,"Sorry you must wait "..(ctld_c.crateWait[_heli:getPlayerName()]  - timer.getTime()).. " seconds before you can get another crate", ctld_c.displayMessageTime)
