            end
                --   trigger.action.outText("Spawn Crate".._args[1].." ".._args[2],10)

            local _heli = ctld_c.getTransportUnit(_args[1])

            local _point = ctld_c.getPointAt12Oclock(_heli, 30)

            local _unitId = ctld_c.getNextUnitId()

            local _side = _heli:getCoalition()

            local _name = string.format("%s #%i", _crateType.desc, _unitId)

            local _spawnedCrate = ctld_c.spawnCrateStatic(_heli:getCountry(), _unitId, _point, _name, _crateType.weight, _side, _crateType.obj_crate)

            -- add to move table
			
			if debugProcessDetail then
				env.info("ctld_c spawnCrate: adding crate to ctld_c.crateMove " .. tostring(_name))
			end
			ctld_c.crateMove[_name] = _name


            ctld_c.displayMessageToGroup(_heli, string.format("A %s crate weighing %s kg has been brought out and is at your 12 o'clock ", _crateType.desc, _crateType.weight), ctld_c.displayMessageTime)
            --if _crateType.factory then
            --    ctld_c.displayMessageToGroup(_heli, string.format("Constructible crates must be delivered to a logistic site to be unpacked."), ctld_c.displayMessageTime)
            --    local n = _heli:getName()
            --    ctld_c.msgNearestLogistic({n})
            --end
        else
