        end
    end, _arguments)

    if (not _status) then
        env.error(string.format("ctld_c ERROR: %s", _err))
    end
end

function ctld_c.getPointAt12Oclock(_unit, _offset)

    local _position = _unit:getPosition()
    local _angle = math.atan2(_position.x.z, _position.x.x)
    local _xOffset = math.cos(_angle) * _offset
    local _yOffset = math.sin(_angle) * _offset

    local _point = _unit:getPoint()
    return { x = _point.x + _xOffset, z = _point.z + _yOffset, y = _point.y }
end

function ctld_c.troopsOnboard(_heli, _troops)

    if ctld_c.inTransitTroops[_heli:getName()] ~= nil then

        local _onboard = ctld_c.inTransitTroops[_heli:getName()]

        if _troops then

            if _onboard.troops ~= nil and _onboard.troops.units ~= nil and #_onboard.troops.units > 0 then
                return true
            else
                return false
            end
        else

            if _onboard.vehicles ~= nil and _onboard.vehicles.units ~= nil and #_onboard.vehicles.units > 0 then
                return true
            else
                return false
            end
        end

    else
        return false
    end
end

-- if its dropped by AI then there is no player name so return the type of unit
function ctld_c.getPlayerNameOrType(_heli)

    if _heli:getPlayerName() == nil then

        return _heli:getTypeName()
    else
        return _heli:getPlayerName()
    end
end

function ctld_c.getPlayerNameOrUnitName(_heli)
    if _heli then
        if _heli:getPlayerName() == nil then
            if _heli:getName() then
                return _heli:getTypeName() .. ", name: " .. _heli:getName()
            end
        else
            return _heli:getPlayerName()
        end
    end
end

function ctld_c.inExtractZone(_heli)

    local _heliPoint = _heli:getPoint()

    for _, _zoneDetails in pairs(ctld_c.extractZones) do

        --get distance to center
        local _dist = ctld_c.getDistance(_heliPoint, _zoneDetails.point)

        if _dist <= _zoneDetails.radius then
            return _zoneDetails
        end
    end

    return false
end

-- safe to fast rope if speed is less than 0.5 Meters per second
function ctld_c.safeToFastRope(_heli)

    if ctld_c.enableFastRopeInsertion == false then
        return false
    end

    --landed or speed is less than 8 km/h and height is less than fast rope height
    if (ctld_c.inAir(_heli) == false or (ctld_c.heightDiff(_heli) <= ctld_c.fastRopeMaximumHeight + 3.0 and ctld_c.vecmag(_heli:getVelocity()) < 2.2)) then
        return true
    end
end

function ctld_c.metersToFeet(_meters)

    local _feet = _meters * 3.2808399

    return ctld_c.round(_feet)
end

function ctld_c.inAir(_heli)

    if _heli:inAir() == false then
        return false
    end

    -- less than 5 cm/s a second so landed
    -- BUT AI can hold a perfect hover so ignore AI
    if ctld_c.vecmag(_heli:getVelocity()) < 0.05 and _heli:getPlayerName() ~= nil then
        return false
    end
    return true
end

function ctld_c.deployTroops(_heli, _troops)

    local _onboard = ctld_c.inTransitTroops[_heli:getName()]

    -- deploy troops
    if _troops then
        if _onboard.troops ~= nil and #_onboard.troops.units > 0 then
            if ctld_c.inAir(_heli) == false or ctld_c.safeToFastRope(_heli) then

                -- check we're not in extract zone
                local _extractZone = ctld_c.inExtractZone(_heli)

                if _extractZone == false then

                    local _droppedTroops = ctld_c.spawnDroppedGroup(_heli:getPoint(), _onboard.troops, false)

                    if _heli:getCoalition() == 1 then

                        table.insert(ctld_c.droppedTroopsRED, _droppedTroops:getName())
                    elseif _heli:getCoalition() == 2 then

                        table.insert(ctld_c.droppedTroopsBLUE, _droppedTroops:getName())

                    else
                        
                        table.insert(ctld_c.droppedTroopsNEUTRAL, _droppedTroops:getName())
                    end

                    ctld_c.inTransitTroops[_heli:getName()].troops = nil
					
					local _weightkg = ctld_c.checkInternalWeight(_heli)
					local _weightlbs = math.floor(_weightkg * 2.20462)
					trigger.action.setUnitInternalCargo(_heli:getName(), _weightkg )
					ctld_c.displayMessageToGroup(_heli, "Your internal cargo weight is now ".. _weightkg .. "kg/" .. _weightlbs .. "lbs", ctld_c.displayMessageTime/4, false)
					
                    if ctld_c.inAir(_heli) then
                        trigger.action.outTextForCoalition(_heli:getCoalition(), ctld_c.getPlayerNameOrType(_heli) .. " troops fast-ropped from " .. _heli:getTypeName() .. " into combat", ctld_c.displayMessageTime/2)
                    else
                        trigger.action.outTextForCoalition(_heli:getCoalition(), ctld_c.getPlayerNameOrType(_heli) .. " troops dropped from " .. _heli:getTypeName() .. " into combat", ctld_c.displayMessageTime/2)
                    end

                    ctld_c.processCallback({unit = _heli, unloaded = _droppedTroops, action = "dropped_troops"})
	

                else
                    --extract zone!
                    local _droppedCount = trigger.misc.getUserFlag(_extractZone.flag)

                    _droppedCount = (#_onboard.troops.units) + _droppedCount

                    trigger.action.setUserFlag(_extractZone.flag, _droppedCount)

                    ctld_c.inTransitTroops[_heli:getName()].troops = nil
					
					local _weightkg = ctld_c.checkInternalWeight(_heli)
					local _weightlbs = math.floor(_weightkg * 2.20462)
					trigger.action.setUnitInternalCargo(_heli:getName(), _weightkg )
					ctld_c.displayMessageToGroup(_heli, "Your internal cargo weight is now ".. _weightkg .. "kg/" .. _weightlbs .. "lbs", ctld_c.displayMessageTime/2, false)
					  
                    if ctld_c.inAir(_heli) then
                        trigger.action.outTextForCoalition(_heli:getCoalition(), ctld_c.getPlayerNameOrType(_heli) .. " troops fast-ropped from " .. _heli:getTypeName() .. " into " .. _extractZone.name, ctld_c.displayMessageTime/2)
                    else
                        trigger.action.outTextForCoalition(_heli:getCoalition(), ctld_c.getPlayerNameOrType(_heli) .. " troops dropped from " .. _heli:getTypeName() .. " into " .. _extractZone.name, ctld_c.displayMessageTime/2)
                    end
                end
            else
                ctld_c.displayMessageToGroup(_heli, "Too high or too fast to drop troops into combat! Hover below " .. ctld_c.metersToFeet(ctld_c.fastRopeMaximumHeight) .. " feet or land.", ctld_c.displayMessageTime/2)
            end
        end

    else
        if ctld_c.inAir(_heli) == false then
            if _onboard.vehicles ~= nil and #_onboard.vehicles.units > 0 then

                local _droppedVehicles = ctld_c.spawnDroppedGroup(_heli:getPoint(), _onboard.vehicles, true)

                if _heli:getCoalition() == 1 then

                    table.insert(ctld_c.droppedVehiclesRED, _droppedVehicles:getName())
                elseif _heli:getCoalition() == 2 then
                
                    table.insert(ctld_c.droppedVehiclesBLUE, _droppedVehicles:getName())
                
                else



                    table.insert(ctld_c.droppedVehiclesNEUTRAL, _droppedVehicles:getName())
                end

                ctld_c.inTransitTroops[_heli:getName()].vehicles = nil

                ctld_c.processCallback({unit = _heli, unloaded = _droppedVehicles, action = "dropped_vehicles"})
				
				local _weightkg = ctld_c.checkInternalWeight(_heli)
				local _weightlbs = math.floor(_weightkg * 2.20462)
				trigger.action.setUnitInternalCargo(_heli:getName(), _weightkg )
				ctld_c.displayMessageToGroup(_heli, "Your internal cargo weight is now ".. _weightkg .. "kg/" .. _weightlbs .. "lbs", ctld_c.displayMessageTime, false)
					
                trigger.action.outTextForCoalition(_heli:getCoalition(), ctld_c.getPlayerNameOrType(_heli) .. " dropped vehicles from " .. _heli:getTypeName() .. " into combat", ctld_c.displayMessageTime/2)
            end
        end
    end

end

function ctld_c.insertIntoTroopsArray(_troopType,_count,_troopArray)

    for _i = 1, _count do
        local _unitId = ctld_c.getNextUnitId()
        table.insert(_troopArray, { type = _troopType, unitId = _unitId, name = string.format("Dropped %s #%i", _troopType, _unitId) })
    end

    return _troopArray

end


function ctld_c.generateTroopTypes(_side, _countOrTemplate, _country)

    local _troops = {}
    local smb = ctld_c.soldierModelBlue
    local smr = ctld_c.soldierModelRed

    --modify arab
    if _country == 2 or _country == 16 or _country == 20 then
        smb = ctld_c.soldierModelBlue
        smr = ctld_c.soldierModelBlue        
    elseif _country == 0 or _country == 1 or _country == 19 then
        smb = ctld_c.soldierModelRed
        smr = ctld_c.soldierModelRed
    elseif _country == 17 or _country == 42 or _country == 72 or _country == 74 or _country == 34 or _country == 58  or _country == 59  or _country == 48  or _country == 71 or _country == 71 or _country == 29 or _country == 47 then
        smb = ctld_c.soldierModelInsurg
        smr = ctld_c.soldierModelInsurg        
    end
    -- reset for wwII!
    if ctld_c.modernSet == false then
        smb = ctld_c.soldierModelBlueWWII
        smr = ctld_c.soldierModelRedWWII
        if _country == 4 then
            smb = ctld_c.soldierModelBlueWWIIUK
            smr = ctld_c.soldierModelBlueWWIIUK
        elseif _country == 66 then
            smb = ctld_c.soldierModelRedWWII
            smr = ctld_c.soldierModelRedWWII
        elseif _country == 2 then
            smb = ctld_c.soldierModelBlueWWII
            smr = ctld_c.soldierModelBlueWWII
        end
    end

    if type(_countOrTemplate) == "table" then

        if _countOrTemplate.aa then
            if _side == 2 then
                _troops = ctld_c.insertIntoTroopsArray("Stinger manpad",_countOrTemplate.aa,_troops)
            else
                _troops = ctld_c.insertIntoTroopsArray("SA-18 Igla manpad",_countOrTemplate.aa,_troops)
            end
        end

        if _countOrTemplate.inf then
            if _side == 2 then
                _troops = ctld_c.insertIntoTroopsArray(smb,_countOrTemplate.inf,_troops)
            else
                _troops = ctld_c.insertIntoTroopsArray(smr,_countOrTemplate.inf,_troops)
            end
        end

        if _countOrTemplate.mg then
            _troops = ctld_c.insertIntoTroopsArray("Soldier M249",_countOrTemplate.mg,_troops)
        end

        if _countOrTemplate.at then
            _troops = ctld_c.insertIntoTroopsArray("Paratrooper RPG-16",_countOrTemplate.at,_troops)
        end

        if _countOrTemplate.mortar then
            _troops = ctld_c.insertIntoTroopsArray("2B11 mortar",_countOrTemplate.mortar,_troops)
        end

    else
        for _i = 1, _countOrTemplate do

            local _unitType = smb

            if _side == 2 then
                _unitType = smb

                if _i <= 5 and ctld_c.spawnStinger then
                    _unitType = "Stinger manpad"
                end
                if _i <= 4 and ctld_c.spawnRPGWithCoalition then
                    _unitType = "Paratrooper RPG-16"
                end
                if _i <= 2 then
                    _unitType = "Soldier M249"
                end
            else
                _unitType = smr
                if _i <= 5 and ctld_c.spawnStinger then
                    _unitType = "SA-18 Igla manpad"
                end
                if _i <= 4 then
                    _unitType = "Paratrooper RPG-16"
                end
                if _i <= 2 then
                    _unitType = "Paratrooper AKS-74"
                end
            end

            local _unitId = ctld_c.getNextUnitId()

            _troops[_i] = { type = _unitType, unitId = _unitId, name = string.format("Dropped %s #%i", _unitType, _unitId) }
        end
    end

    local _groupId = ctld_c.getNextGroupId()
    local _details = { units = _troops, groupId = _groupId, groupName = string.format("Dropped Group %i", _groupId), side = _side, country = _country }

    return _details
end

--Special F10 function for players for troops
function ctld_c.unloadExtractTroops(_args)

    local _heli = ctld_c.getTransportUnit(_args[1])

    if _heli == nil then
        return false
    end

    local _extract = nil
    if not ctld_c.inAir(_heli) then
        if _heli:getCoalition() == 1 then
            _extract = ctld_c.findNearestGroup(_heli, ctld_c.droppedTroopsRED)
        elseif _heli:getCoalition() == 2 then
            _extract = ctld_c.findNearestGroup(_heli, ctld_c.droppedTroopsBLUE)
        else
            _extract = ctld_c.findNearestGroup(_heli, ctld_c.droppedTroopsNEUTRAL)
        end

    end

    if _extract ~= nil and not ctld_c.troopsOnboard(_heli, true) then
        -- search for nearest troops to pickup
        return ctld_c.extractMultiTroops({_heli:getName(), true})  -- TEST DSMC
    else
        return ctld_c.unloadMultiTroops({_heli:getName(),true,true})
    end


end

-- load troops onto vehicle
function ctld_c.loadTroops(_heli, _troops, _numberOrTemplate)

    -- load troops + vehicles if c130 or herc
    -- "M1045 HMMWV TOW"
    -- "M1043 HMMWV Armament"
    local _onboard = ctld_c.inTransitTroops[_heli:getName()]

    --number doesnt apply to vehicles
    if _numberOrTemplate == nil  or (type(_numberOrTemplate) ~= "table" and type(_numberOrTemplate) ~= "number")  then
        _numberOrTemplate = ctld_c.numberOfTroops
    end

    if _onboard == nil then
        _onboard = { troops = {}, vehicles = {} }
    end

    local _list
    if _heli:getCoalition() == 1 then
        _list = ctld_c.vehiclesForTransportRED
    elseif _heli:getCoalition() == 2 then
        _list = ctld_c.vehiclesForTransportBLUE
	else
        _list = ctld_c.vehiclesForTransportNEUTRAL
    end

    if _troops then

        _onboard.troops = ctld_c.generateTroopTypes(_heli:getCoalition(), _numberOrTemplate, _heli:getCountry())

        trigger.action.outTextForCoalition(_heli:getCoalition(), ctld_c.getPlayerNameOrType(_heli) .. " loaded troops into " .. _heli:getTypeName(), ctld_c.displayMessageTime/2)

        ctld_c.processCallback({unit = _heli, onboard = _onboard.troops, action = "load_troops"})	
		
    else

        _onboard.vehicles = ctld_c.generateVehiclesForTransport(_heli:getCoalition(), _heli:getCountry())

        local _count = #_list
        ctld_c.processCallback({unit = _heli, onboard = _onboard.vehicles, action = "load_vehicles"})
        trigger.action.outTextForCoalition(_heli:getCoalition(), ctld_c.getPlayerNameOrType(_heli) .. " loaded " .. _count .. " vehicles into " .. _heli:getTypeName(), ctld_c.displayMessageTime/2)
    end

    ctld_c.inTransitTroops[_heli:getName()] = _onboard
	
	local _weightkg = ctld_c.checkInternalWeight(_heli)
	local _weightlbs = math.floor(_weightkg * 2.20462)
	trigger.action.setUnitInternalCargo(_heli:getName(), _weightkg )
	ctld_c.displayMessageToGroup(_heli, "Your internal cargo weight is now ".. _weightkg .. "kg/" .. _weightlbs .. "lbs", ctld_c.displayMessageTime, false)
	
end

function ctld_c.generateVehiclesForTransport(_side, _country)

    local _vehicles = {}
    local _list
    if _side == 1 then
        _list = ctld_c.vehiclesForTransportRED
    elseif _side == 2 then
        _list = ctld_c.vehiclesForTransportBLUE
	else
        _list = ctld_c.vehiclesForTransportNEUTRAL
    end

    for _i, _type in ipairs(_list) do

        local _unitId = ctld_c.getNextUnitId()

        _vehicles[_i] = { type = _type, unitId = _unitId, name = string.format("Dropped %s #%i", _type, _unitId) }
    end


    local _groupId = ctld_c.getNextGroupId()
    local _details = { units = _vehicles, groupId = _groupId, groupName = string.format("Dropped Group %i", _groupId), side = _side, country = _country }

    return _details
end

function ctld_c.loadUnloadFOBCrate(_args)

    local _heli = ctld_c.getTransportUnit(_args[1])
    local _troops = _args[2]

    if _heli == nil then
        return
    end

    if ctld_c.inAir(_heli) == true then
        return
    end


    local _side = _heli:getCoalition()

    local _inZone = ctld_c.inLogisticsZone(_heli)
    local _crateOnboard = ctld_c.inTransitFOBCrates[_heli:getName()] ~= nil

    if _inZone == false and _crateOnboard == true then

        ctld_c.inTransitFOBCrates[_heli:getName()] = nil

        local _position = _heli:getPosition()

        --try to spawn at 6 oclock to us
        local _angle = math.atan2(_position.x.z, _position.x.x)
        local _xOffset = math.cos(_angle) * -60
        local _yOffset = math.sin(_angle) * -60

        local _point = _heli:getPoint()

        local _side = _heli:getCoalition()

        local _unitId = ctld_c.getNextUnitId()

        local _name = string.format("FOB Crate #%i", _unitId)

        local _spawnedCrate = ctld_c.spawnFOBCrateStatic(_heli:getCountry(), ctld_c.getNextUnitId(), { x = _point.x + _xOffset, z = _point.z + _yOffset }, _name)

        if _side == 1 then
            ctld_c.droppedFOBCratesRED[_name] = _name
        elseif _side == 2 then
            ctld_c.droppedFOBCratesBLUE[_name] = _name
        else
            ctld_c.droppedFOBCratesNEUTRAL[_name] = _name
        end
        
        trigger.action.outTextForCoalition(_heli:getCoalition(), ctld_c.getPlayerNameOrType(_heli) .. " delivered a FOB Crate", ctld_c.displayMessageTime/2)
		
		local _weightkg = ctld_c.checkInternalWeight(_heli)
		local _weightlbs = math.floor(_weightkg * 2.20462)
		trigger.action.setUnitInternalCargo(_heli:getName(), _weightkg )
		ctld_c.displayMessageToGroup(_heli, "Your internal cargo weight is now ".. _weightkg .. "kg/" .. _weightlbs .. "lbs", ctld_c.displayMessageTime, false)
					
        ctld_c.displayMessageToGroup(_heli, "Delivered FOB Crate 60m at 6'oclock to you", ctld_c.displayMessageTime/2)

    elseif _inZone == true and _crateOnboard == true then

        ctld_c.displayMessageToGroup(_heli, "FOB Crate dropped back to base", ctld_c.displayMessageTime/2)
		
        ctld_c.inTransitFOBCrates[_heli:getName()] = nil
		
		local _weightkg = ctld_c.checkInternalWeight(_heli)
		local _weightlbs = math.floor(_weightkg * 2.20462)
		trigger.action.setUnitInternalCargo(_heli:getName(), _weightkg ) 
        ctld_c.displayMessageToGroup(_heli, "FOB Crate Loaded", ctld_c.displayMessageTime/2)

        ctld_c.inTransitFOBCrates[_heli:getName()] = true
        trigger.action.outTextForCoalition(_heli:getCoalition(), ctld_c.getPlayerNameOrType(_heli) .. " loaded a FOB Crate ready for delivery!", ctld_c.displayMessageTime/2)
		
		local _weightkg = ctld_c.checkInternalWeight(_heli)
		local _weightlbs = math.floor(_weightkg * 2.20462)
		trigger.action.setUnitInternalCargo(_heli:getName(), _weightkg )
		ctld_c.displayMessageToGroup(_heli, "Your internal cargo weight is now ".. _weightkg .. "kg/" .. _weightlbs .. "lbs", ctld_c.displayMessageTime, false)
		
    else

        -- nearest Crate
        local _crates = ctld_c.getCratesAndDistance(_heli)
        local _nearestCrate = ctld_c.getClosestCrate(_heli, _crates, "FOB")

        if _nearestCrate ~= nil and _nearestCrate.dist < 150 then

            ctld_c.displayMessageToGroup(_heli, "FOB Crate Loaded", 10)
            ctld_c.inTransitFOBCrates[_heli:getName()] = true
            trigger.action.outTextForCoalition(_heli:getCoalition(), ctld_c.getPlayerNameOrType(_heli) .. " loaded a FOB Crate ready for delivery!", ctld_c.displayMessageTime/2)
			
			local _weightkg = ctld_c.checkInternalWeight(_heli)
			local _weightlbs = math.floor(_weightkg * 2.20462)
			trigger.action.setUnitInternalCargo(_heli:getName(), _weightkg )
			ctld_c.displayMessageToGroup(_heli, "Your internal cargo weight is now ".. _weightkg .. "kg/" .. _weightlbs .. "lbs", 20, false)
					
            if _side == 1 then
                ctld_c.droppedFOBCratesRED[_nearestCrate.crateUnit:getName()] = nil
            elseif _side == 2 then
                ctld_c.droppedFOBCratesBLUE[_nearestCrate.crateUnit:getName()] = nil
            else
                ctld_c.droppedFOBCratesNEUTRAL[_nearestCrate.crateUnit:getName()] = nil
            end

            --remove
            _nearestCrate.crateUnit:destroy()

        else
            ctld_c.displayMessageToGroup(_heli, "There are no friendly logistic units nearby to load a FOB crate from!", ctld_c.displayMessageTime/2)
        end
    end
end

function ctld_c.loadTroopsFromZone(_args)

    local _heli = ctld_c.getTransportUnit(_args[1])
    local _troops = _args[2]
    local _groupTemplate = _args[3] or ""
    local _allowExtract = _args[4]

    if _heli == nil then
        return false
    end

    local _zone = ctld_c.inPickupZone(_heli)

    if ctld_c.troopsOnboard(_heli, _troops) then

        if _troops then
            ctld_c.displayMessageToGroup(_heli, "You already have troops onboard.", ctld_c.displayMessageTime/4)
        else
            ctld_c.displayMessageToGroup(_heli, "You already have vehicles onboard.", ctld_c.displayMessageTime/4)
        end

        return false
    end

    local _extract
    local _soldiers = false
    if _allowExtract then
        -- first check for extractable troops regardless of if we're in a zone or not
        if _troops then
            if _heli:getCoalition() == 1 then
                _extract = ctld_c.findNearestGroup(_heli, ctld_c.droppedTroopsRED)
                _soldiers = true -- DSMC
            elseif _heli:getCoalition() == 2 then
                _soldiers = true-- DSMC
                _extract = ctld_c.findNearestGroup(_heli, ctld_c.droppedTroopsBLUE)
            else
                _soldiers = true-- DSMC
                _extract = ctld_c.findNearestGroup(_heli, ctld_c.droppedTroopsNEUTRAL)
            end
                 
        else

            if _heli:getCoalition() == 1 then
                _extract = ctld_c.findNearestGroup(_heli, ctld_c.droppedVehiclesRED)
            elseif _heli:getCoalition() == 21 then
                _extract = ctld_c.findNearestGroup(_heli, ctld_c.droppedVehiclesBLUE)
            else
                _extract = ctld_c.findNearestGroup(_heli, ctld_c.droppedVehiclesNEUTRAL)
            end
        end
    end

    if _extract ~= nil then
        -- search for nearest troops to pickup
        if _soldiers == true then
            return ctld_c.extractMultiTroops({_heli:getName(), _troops})
        else
            return ctld_c.extractTroops({_heli:getName(), _troops})
        end

    elseif _zone.inZone == true then --- QUI PER LOAD TRUPPE AUTOMATICO

        if _zone.limit - 1 >= 0 then
            -- decrease zone counter by 1
            ctld_c.updateZoneCounter(_zone.index, -1)

            ctld_c.loadTroops(_heli, _troops,_groupTemplate)

            return true
        else
            ctld_c.displayMessageToGroup(_heli, "This area has no more reinforcements available!", ctld_c.displayMessageTime)

            return false
        end

    else
        if _allowExtract then
            ctld_c.displayMessageToGroup(_heli, "You are not in a pickup zone and no one is nearby to extract", ctld_c.displayMessageTime/2)
        else
            ctld_c.displayMessageToGroup(_heli, "You are not in a pickup zone", ctld_c.displayMessageTime/2)
        end

        return false
    end
end

-- DSMC ADDED
function ctld_c.loadMultiTroops(_unit, _troops, _numberOrTemplate)
    if _troops == false then
        if _unit:hasAttribute("APC") or _unit:hasAttribute("IFV") or _unit:hasAttribute("Trucks") then
            local _group = _unit:getGroup()
            if _group then
                local _units = _group:getUnits()
                if _units then
                    for _, uData in pairs(_units) do
                        local uName = uData:getName()
                        env.info("DSMC loadMultiTroops uName: " .. tostring(uName))
                        local u_heli = ctld_c.getTransportUnit(uName)

                        if u_heli then
                            env.info("DSMC loadMultiTroops uName: done")
                            ctld_c.loadTroops(u_heli, _troops, _numberOrTemplate)
                        else
                            env.info("DSMC loadMultiTroops u_heli missing")
                        end

                    end
                else
                    env.info("DSMC loadMultiTroops _units missing")
                end
            else
                env.info("DSMC loadMultiTroops _group missing")
            end
        else
            env.info("DSMC loadMultiTroops is a plane-helo")
            ctld_c.loadTroops(_unit, _troops, _numberOrTemplate)
        end
    else
        env.info("DSMC loadMultiTroops is for vehicles, multiple not admitted")
        ctld_c.loadTroops(_unit, _troops, _numberOrTemplate)
    end        
end

function ctld_c.extractMultiTroops(_args) -- TEST DSMC
    local _unit = ctld_c.getTransportUnit(_args[1]) 
    if _unit:hasAttribute("APC") or _unit:hasAttribute("IFV") or _unit:hasAttribute("Trucks") then
        local _group = _unit:getGroup()
        if _group then
            local _units = _group:getUnits()
            if _units then
                for _, uData in pairs(_units) do
                    local uName = uData:getName()
                    env.info("DSMC extractMultiTroops uName: " .. tostring(uName))
                    local u_heli = ctld_c.getTransportUnit(uName)

                    if u_heli then
                        local u_extract = nil
                        if not ctld_c.inAir(u_heli) then
                            if u_heli:getCoalition() == 1 then
                                u_extract = ctld_c.findNearestGroup(u_heli, ctld_c.droppedTroopsRED)
                            elseif u_heli:getCoalition() == 2 then
                                u_extract = ctld_c.findNearestGroup(u_heli, ctld_c.droppedTroopsBLUE)
                            else
                                u_extract = ctld_c.findNearestGroup(u_heli, ctld_c.droppedTroopsNEUTRAL)
                            end
                            
                        end                    

                        if u_extract ~= nil and not ctld_c.troopsOnboard(u_heli, true) then
                            -- search for nearest troops to pickup
                            env.info("DSMC extractMultiTroops uName: done")
                            ctld_c.extractTroops({uName, true})
                        end
                    else
                        env.info("DSMC extractMultiTroops u_heli missing")
                    end

                end
            else
                env.info("DSMC extractMultiTroops _units missing")
            end
        else
            env.info("DSMC extractMultiTroops _group missing")
        end
    else
        env.info("DSMC extractMultiTroops is a plane-helo")
        ctld_c.extractTroops(_args)
    end
end

function ctld_c.unloadMultiTroops(_args) -- TEST DSMC
    local _unit = ctld_c.getTransportUnit(_args[1])                
    if _unit:hasAttribute("APC") or _unit:hasAttribute("IFV") or _unit:hasAttribute("Trucks") then
        local _group = _unit:getGroup()
        if _group then
            local _units = _group:getUnits()
            if _units then
                for _, uData in pairs(_units) do
                    local uName = uData:getName()
                    env.info("DSMC unloadMultiTroops uName: " .. tostring(uName))
