function ctld_c.unloadTroops(_args)

    local _heli = ctld_c.getTransportUnit(_args[1])
    local _troops = _args[2]

    if _heli == nil then
        return false
    end

    local _zone = ctld_c.inPickupZone(_heli)
    if not ctld_c.troopsOnboard(_heli, _troops)  then

        ctld_c.displayMessageToGroup(_heli, "No one to unload", ctld_c.displayMessageTime/2)

        return false
    else

        -- troops must be onboard to get here
        if _zone.inZone == true  then

            if _troops then
                ctld_c.displayMessageToGroup(_heli, "Dropped troops back to base", ctld_c.displayMessageTime/2)

                ctld_c.processCallback({unit = _heli, unloaded = ctld_c.inTransitTroops[_heli:getName()].troops, action = "unload_troops_zone"})

                ctld_c.inTransitTroops[_heli:getName()].troops = nil
				
				local _weightkg = ctld_c.checkInternalWeight(_heli)
				local _weightlbs = math.floor(_weightkg * 2.20462)
				trigger.action.setUnitInternalCargo(_heli:getName(), _weightkg )
				ctld_c.displayMessageToGroup(_heli, "Your internal cargo weight is now ".. _weightkg .. "kg/" .. _weightlbs .. "lbs", ctld_c.displayMessageTime, false)

            else
                ctld_c.displayMessageToGroup(_heli, "Dropped vehicles back to base", ctld_c.displayMessageTime/2)

                ctld_c.processCallback({unit = _heli, unloaded = ctld_c.inTransitTroops[_heli:getName()].vehicles, action = "unload_vehicles_zone"})

                ctld_c.inTransitTroops[_heli:getName()].vehicles = nil
				
				local _weightkg = ctld_c.checkInternalWeight(_heli)
				local _weightlbs = math.floor(_weightkg * 2.20462)
				trigger.action.setUnitInternalCargo(_heli:getName(), _weightkg )
				ctld_c.displayMessageToGroup(_heli, "Your internal cargo weight is now ".. _weightkg .. "kg/" .. _weightlbs .. "lbs", ctld_c.displayMessageTime, false)
				
            end

            -- increase zone counter by 1
            ctld_c.updateZoneCounter(_zone.index, 1)

            return true

        elseif _zone.inZone == false and ctld_c.troopsOnboard(_heli, _troops)  then

            return ctld_c.deployTroops(_heli, _troops)
        end
    end

end

function ctld_c.extractTroops(_args)

    local _heli = ctld_c.getTransportUnit(_args[1])
    local _troops = _args[2]

    if _heli == nil then
        return false
    end

    if ctld_c.inAir(_heli) then
        return false
    end

    if  ctld_c.troopsOnboard(_heli, _troops)  then
        if _troops then
            ctld_c.displayMessageToGroup(_heli, "You already have troops onboard.", ctld_c.displayMessageTime/2)
        else
            ctld_c.displayMessageToGroup(_heli, "You already have vehicles onboard.", ctld_c.displayMessageTime/2)
        end

        return false
    end

    local _onboard = ctld_c.inTransitTroops[_heli:getName()]

    if _onboard == nil then
        _onboard = { troops = nil, vehicles = nil }
    end

    local _extracted = false

    if _troops then

        local _extractTroops

        if _heli:getCoalition() == 1 then
            _extractTroops = ctld_c.findNearestGroup(_heli, ctld_c.droppedTroopsRED)
        else
            _extractTroops = ctld_c.findNearestGroup(_heli, ctld_c.droppedTroopsBLUE)
        end


        if _extractTroops ~= nil then

            local _limit = ctld_c.getTransportLimit(_heli:getTypeName())

            local _size =  #_extractTroops.group:getUnits()

            if _limit < #_extractTroops.group:getUnits() then

                ctld_c.displayMessageToGroup(_heli, "Sorry - The group of ".._size.." is too large to fit. \n\nLimit is ".._limit.." for ".._heli:getTypeName(), ctld_c.displayMessageTime)

                return
            end


            _onboard.troops = _extractTroops.details

            trigger.action.outTextForCoalition(_heli:getCoalition(), ctld_c.getPlayerNameOrType(_heli) .. " extracted troops in " .. _heli:getTypeName() .. " from combat", ctld_c.displayMessageTime/2)

            if _heli:getCoalition() == 1 then
                ctld_c.droppedTroopsRED[_extractTroops.group:getName()] = nil
            elseif _heli:getCoalition() == 2 then
                ctld_c.droppedTroopsBLUE[_extractTroops.group:getName()] = nil
            else
                ctld_c.droppedTroopsNEUTRAL[_extractTroops.group:getName()] = nil
            end
       
		
			-- local _heliName = _heli:getName()
			-- if _heliName then
				-- local number = #_extractTroops.group:getUnits()
				-- if number then
					-- local weight = ctld_c.soldierWeight * number
					-- --CARGOWEIGHT adjust here
					-- trigger.action.setUnitInternalCargo(_heliName, weight)
					-- env.info("DSMC extractTroops set cargo " .. tostring(weight) .. " kg")
					-- local _weightkg = ctld_c.checkInternalWeight(_heli)
					-- local _weightlbs = math.floor(_weightkg * 2.20462)
					-- trigger.action.setUnitInternalCargo(_heli:getName(), _weightkg )
					-- ctld_c.displayMessageToGroup(_heli, "Your internal cargo weight is now ".. _weightkg .. "kg/" .. _weightlbs .. "lbs", 20, false)
				-- else
					-- env.info("DSMC extractTroops no unit number for cargo")				
				-- end
			-- end	

            ctld_c.processCallback({unit = _heli, extracted = _extractTroops, action = "extract_troops"})

            --remove
            _extractTroops.group:destroy()

            _extracted = true
        else
            _onboard.troops = nil
            ctld_c.displayMessageToGroup(_heli, "No extractable troops nearby!", 20)
        end

    else

        local _extractVehicles


        if _heli:getCoalition() == 1 then

            _extractVehicles = ctld_c.findNearestGroup(_heli, ctld_c.droppedVehiclesRED)
        elseif _heli:getCoalition() == 1 then

            _extractVehicles = ctld_c.findNearestGroup(_heli, ctld_c.droppedVehiclesBLUE)
        else
        
            _extractVehicles = ctld_c.findNearestGroup(_heli, ctld_c.droppedVehiclesNEUTRAL)
        
        end

        if _extractVehicles ~= nil then
            _onboard.vehicles = _extractVehicles.details

            if _heli:getCoalition() == 1 then

                ctld_c.droppedVehiclesRED[_extractVehicles.group:getName()] = nil
            elseif _heli:getCoalition() == 2 then

                ctld_c.droppedVehiclesBLUE[_extractVehicles.group:getName()] = nil
            else
            
                ctld_c.droppedVehiclesNEUTRAL[_extractVehicles.group:getName()] = nil
            end

            trigger.action.outTextForCoalition(_heli:getCoalition(), ctld_c.getPlayerNameOrType(_heli) .. " extracted vehicles in " .. _heli:getTypeName() .. " from combat", ctld_c.displayMessageTime/2)

            ctld_c.processCallback({unit = _heli, extracted = _extractVehicles, action = "extract_vehicles"})
            --remove
            _extractVehicles.group:destroy()
            _extracted = true

        else
            _onboard.vehicles = nil
            ctld_c.displayMessageToGroup(_heli, "No extractable vehicles nearby!", ctld_c.displayMessageTime)
        end
    end

    ctld_c.inTransitTroops[_heli:getName()] = _onboard
	
	local _weightkg = ctld_c.checkInternalWeight(_heli)
	local _weightlbs = math.floor(_weightkg * 2.20462)
	trigger.action.setUnitInternalCargo(_heli:getName(), _weightkg )
	ctld_c.displayMessageToGroup(_heli, "Your internal cargo weight is now ".. _weightkg .. "kg/" .. _weightlbs .. "lbs", ctld_c.displayMessageTime, false)

    return _extracted
end
