function ctld_c.checkTroopStatus(_args)

    --list onboard troops, if c130
    local _heli = ctld_c.getTransportUnit(_args[1])

    if _heli == nil then
        return
    end

    local _onboard = ctld_c.inTransitTroops[_heli:getName()]

    if _onboard == nil then

        if ctld_c.inTransitFOBCrates[_heli:getName()] == true then
            ctld_c.displayMessageToGroup(_heli, "1 FOB Crate Onboard", ctld_c.displayMessageTime/2)
        else
            ctld_c.displayMessageToGroup(_heli, "No troops onboard", ctld_c.displayMessageTime/2)
        end


    else
        local _troops = _onboard.troops
        local _vehicles = _onboard.vehicles

        local _txt = ""

        if _troops ~= nil and _troops.units ~= nil and #_troops.units > 0 then
            _txt = _txt .. " " .. #_troops.units .. " troops onboard\n"
        end

        if _vehicles ~= nil and _vehicles.units ~= nil and #_vehicles.units > 0 then
            _txt = _txt .. " " .. #_vehicles.units .. " vehicles onboard\n"
        end

        if ctld_c.inTransitFOBCrates[_heli:getName()] == true then
            _txt = _txt .. " 1 FOB Crate oboard\n"
        end

        if _txt ~= "" then
            ctld_c.displayMessageToGroup(_heli, _txt, ctld_c.displayMessageTime/2)
        else
            if ctld_c.inTransitFOBCrates[_heli:getName()] == true then
                ctld_c.displayMessageToGroup(_heli, "1 FOB Crate Onboard", ctld_c.displayMessageTime/2)
            else
                ctld_c.displayMessageToGroup(_heli, "No troops onboard", ctld_c.displayMessageTime/2)
            end
        end
    end
end

