function ctld_c.checkInternalWeight(_group) --_heli  --I think in most cases I will aleady have the heli name so just passing that
	--local _name = _heli:getName()				  --alternative if I need to pass the unit instead
	--Get the number of troops in the helicopter
	--ctld_c.troopsOnboard(_heli, _troops)
	if (ctld_c.troopsOnboard(_group, true) == false) and  (ctld_c.troopsOnboard(_group, false) == false) then   
		_TroopWeight = 0
		env.info("no troops or vics onboard")
	else
		local _onboard = ctld_c.inTransitTroops[_group:getName()]
		--env.info(dump(_onboard))
		--if _onboard[1] ~= nil then
			local number = #_onboard.troops.units
			if number then
				_TroopWeight = ctld_c.soldierWeight * number
				--env.info("Internal troop weight found ".. _TroopWeight)
			else
				env.info("checkInternalWeight ran but failed to get valid data")
				_TroopWeight = 0
			end
		--end
	end
    
	--check if a FOB crate is loaded
	if ctld_c.inTransitFOBCrates[_group:getName()] == nil then
		_FOBWeight = 0
	else
		_FOBWeight = 800
	end
	
	--check if any other crate is loaded		
	if ctld_c.inTransitSlingLoadCrates[_group:getName()] == nil then
		_CrateWeight = 0
	else
		local _currentCrate =  ctld_c.deepCopy(ctld_c.inTransitSlingLoadCrates[_group:getName()])
		_CrateWeight = _currentCrate.weight
	end


	if _TroopWeight and _FOBWeight and _CrateWeight then
		_cargoweight = _TroopWeight + _FOBWeight + _CrateWeight	
	else
		env.info("Something went wrong calculating current cargo weight")
		_cargoweight = 0
	end		
	
    return _cargoweight

end

