function ctld_c.checkHoverStatus()
    -- env.info("checkHoverStatus")
    timer.scheduleFunction(ctld_c.checkHoverStatus, nil, timer.getTime() + 1.0)

    local _status, _result = pcall(function()

        for _, _name in ipairs(ctld_c.transportPilotNames) do

            local _reset = true
            local _transUnit = ctld_c.getTransportUnit(_name)

            --only check transports that are hovering and not planes
            if _transUnit ~= nil and ctld_c.inTransitSlingLoadCrates[_name] == nil and ctld_c.inAir(_transUnit) and ctld_c.unitCanCarryVehicles(_transUnit) == false then

                local _crates = ctld_c.getCratesAndDistance(_transUnit)

                for _, _crate in pairs(_crates) do
                    --   env.info("CRATE: ".._crate.crateUnit:getName().. " ".._crate.dist)
                    if _crate.dist < ctld_c.maxDistanceFromCrate and _crate.details.unit ~= "FOB" then

                        --check height!
                        local _height = _transUnit:getPoint().y - _crate.crateUnit:getPoint().y
                        --env.info("HEIGHT " .. _name .. " " .. _height .. " " .. _transUnit:getPoint().y .. " " .. _crate.crateUnit:getPoint().y)
                        --  ctld_c.heightDiff(_transUnit)
                        --env.info("HEIGHT ABOVE GROUD ".._name.." ".._height.." ".._transUnit:getPoint().y.." ".._crate.crateUnit:getPoint().y)

                        if _height > ctld_c.minimumHoverHeight and _height <= ctld_c.maximumHoverHeight then

                            local _time = ctld_c.hoverStatus[_transUnit:getName()]

                            if _time == nil then
                                ctld_c.hoverStatus[_transUnit:getName()] = ctld_c.hoverTime
                                _time = ctld_c.hoverTime
                            else
                                _time = ctld_c.hoverStatus[_transUnit:getName()] - 1
                                ctld_c.hoverStatus[_transUnit:getName()] = _time
                            end

                            if _time > 0 then
                                ctld_c.displayMessageToGroup(_transUnit, "Hovering above " .. _crate.details.desc .. " crate. \n\nHold hover for " .. _time .. " seconds! \n\nIf the countdown stops you're too far away!", 10,true)
                            else
                                ctld_c.hoverStatus[_transUnit:getName()] = nil
                                ctld_c.displayMessageToGroup(_transUnit, "Loaded  " .. _crate.details.desc .. " crate!", 10,true)

                                --crates been moved once!
								if debugProcessDetail then
									env.info("ctld_c checkHoverStatus: crate moved by sling load and removed from ctld_c.crateMove " .. tostring(_crate.crateUnit:getName()))
								end
                                ctld_c.crateMove[_crate.crateUnit:getName()] = nil

                                if _transUnit:getCoalition() == 1 then
                                    ctld_c.spawnedCratesRED[_crate.crateUnit:getName()] = nil
                                else
                                    ctld_c.spawnedCratesBLUE[_crate.crateUnit:getName()] = nil
                                end

                                _crate.crateUnit:destroy()

                                ctld_c.inTransitSlingLoadCrates[_name] = _crate.details
                            end

                            _reset = false

                            break
                        elseif _height <= ctld_c.minimumHoverHeight then
                            ctld_c.displayMessageToGroup(_transUnit, "Too low to hook " .. _crate.details.desc .. " crate.\n\nHold hover for " .. ctld_c.hoverTime .. " seconds", 5,true)
                            break
                        else
                            ctld_c.displayMessageToGroup(_transUnit, "Too high to hook " .. _crate.details.desc .. " crate.\n\nHold hover for " .. ctld_c.hoverTime .. " seconds", 5, true)
                            break
                        end
                    end
                end
            end

            if _reset then
                ctld_c.hoverStatus[_name] = nil
            end
        end
    end)

    if (not _status) then
        env.error(string.format("ctld_c ERROR: %s", _result))
    end
end
