function ctld_c.loadMultyCrate(_name)
    local _unit = ctld_c.getTransportUnit(_name)
    if _unit:hasAttribute("APC") or _unit:hasAttribute("IFV") or _unit:hasAttribute("Trucks") then
        local _group = _unit:getGroup()
        if _group then
            local _units = _group:getUnits()
            if _units then
                for _, uData in pairs(_units) do
                    local uName = uData:getName()
                    env.info("DSMC loadMultyCrate uName: " .. tostring(uName))
                    ctld_c.loadNearbyCrate(uName)
                end
            else
                env.info("DSMC loadMultyCrate _units missing")
            end
        else
            env.info("DSMC loadMultyCrate _group missing")
        end
    else
        env.info("DSMC loadMultyCrate is a plane-helo")
        ctld_c.loadNearbyCrate(_name)
    end
end


-- END ADD DSMC
function ctld_c.loadNearbyCrate(_name)
    local _transUnit = ctld_c.getTransportUnit(_name)

    if _transUnit ~= nil  then

        if ctld_c.inAir(_transUnit) then
            ctld_c.displayMessageToGroup(_transUnit, "You must land before you can load a crate!", ctld_c.displayMessageTime/2 ,true)
            return
        end

        if ctld_c.inTransitSlingLoadCrates[_name] == nil then
            local _crates = ctld_c.getCratesAndDistance(_transUnit)

            for _, _crate in pairs(_crates) do

                if _crate.dist < ctld_c.crateOpsDistance then
                    ctld_c.displayMessageToGroup(_transUnit, "Loaded  " .. _crate.details.desc .. " crate!", ctld_c.displayMessageTime/2 ,true)

                    if _transUnit:getCoalition() == 1 then
                        ctld_c.spawnedCratesRED[_crate.crateUnit:getName()] = nil
                    elseif _transUnit:getCoalition() == 2 then
                        ctld_c.spawnedCratesBLUE[_crate.crateUnit:getName()] = nil
                    else
                        ctld_c.spawnedCratesNEUTRAL[_crate.crateUnit:getName()] = nil
                    end
					
					if debugProcessDetail then
						env.info("ctld_c checkHoverStatus: crate loaded by F10 and removed from ctld_c.crateMove " .. tostring(_crate.crateUnit:getName()))
					end
                    ctld_c.crateMove[_crate.crateUnit:getName()] = nil

                    _crate.crateUnit:destroy()

                    local _copiedCrate = ctld_c.deepCopy(_crate.details)

                    ctld_c.inTransitSlingLoadCrates[_name] = _copiedCrate
					
					local _weightkg = ctld_c.checkInternalWeight(_transUnit)
					local _weightlbs = math.floor(_weightkg * 2.20462)
					trigger.action.setUnitInternalCargo(_name, _weightkg )
					ctld_c.displayMessageToGroup(_transUnit, "Your internal cargo weight is now ".. _weightkg .. "kg/" .. _weightlbs .. "lbs", ctld_c.displayMessageTime, false)
					
					-- trigger.action.setUnitInternalCargo(_name, ctld_c.checkInternalWeight(_transUnit))
					-- ctld_c.displayMessageToGroup(_transUnit, "Your internal cargo weight is now ".. ctld_c.checkInternalWeight(_transUnit) .. "kg", 20, false)
                    return
                end
            end

            ctld_c.displayMessageToGroup(_transUnit, "No Crates within " .. tostring(ctld_c.crateOpsDistance) .. " m to load!", ctld_c.displayMessageTime/2 ,true)

        else
            -- crate onboard

            local _currentCrate =  ctld_c.deepCopy(ctld_c.inTransitSlingLoadCrates[_name])

            ctld_c.displayMessageToGroup(_transUnit, "You already have a ".._currentCrate.desc.." crate onboard!", ctld_c.displayMessageTime/2 ,true)
        end
    end


end

