function ctld_c.getClockDirection(_heli, _crate)

    -- Source: Helicopter Script - Thanks!

    local _position = _crate:getPosition().p -- get position of crate
    local _playerPosition = _heli:getPosition().p -- get position of helicopter
    local _relativePosition = ctld_c.vecsub(_position, _playerPosition)

    local _playerHeading = ctld_c.getHeading(_heli) -- the rest of the code determines the 'o'clock' bearing of the missile relative to the helicopter

    local _headingVector = { x = math.cos(_playerHeading), y = 0, z = math.sin(_playerHeading) }

    local _headingVectorPerpendicular = { x = math.cos(_playerHeading + math.pi / 2), y = 0, z = math.sin(_playerHeading + math.pi / 2) }

    local _forwardDistance = ctld_c.vecdp(_relativePosition, _headingVector)

    local _rightDistance = ctld_c.vecdp(_relativePosition, _headingVectorPerpendicular)

    local _angle = math.atan2(_rightDistance, _forwardDistance) * 180 / math.pi

    if _angle < 0 then
        _angle = 360 + _angle
    end
    _angle = math.floor(_angle * 12 / 360 + 0.5)
    if _angle == 0 then
        _angle = 12
    end

    return _angle
end


function ctld_c.getCompassBearing(_ref, _unitPos)

    _ref = ctld_c.makeVec3(_ref, 0) -- turn it into Vec3 if it is not already.
    _unitPos = ctld_c.makeVec3(_unitPos, 0) -- turn it into Vec3 if it is not already.

    local _vec = { x = _unitPos.x - _ref.x, y = _unitPos.y - _ref.y, z = _unitPos.z - _ref.z }

    local _dir = ctld_c.getDir(_vec, _ref)

    local _bearing = ctld_c.round(ctld_c.toDegree(_dir), 0)

    return _bearing
end

function ctld_c.listNearbyCrates(_args)
    local _message = ""

    local _heli = ctld_c.getTransportUnit(_args[1])

    if _heli == nil then

        return -- no heli!
    end
    local _crates = ctld_c.getCratesAndDistance(_heli)

    --sort
    local _sort = function( a,b ) return a.dist < b.dist end
    table.sort(_crates,_sort)

    for _, _crate in pairs(_crates) do

        if _crate.dist < 1000 and _crate.details.unit ~= "FOB" then
            _message = string.format("%s\n%s crate - kg %i - %i m - %d o'clock", _message, _crate.details.desc, _crate.details.weight, _crate.dist, ctld_c.getClockDirection(_heli, _crate.crateUnit))
        end
    end


    local _fobMsg = ""
    for _, _fobCrate in pairs(_crates) do

        if _fobCrate.dist < 1000 and _fobCrate.details.unit == "FOB" then
            _fobMsg = _fobMsg .. string.format("FOB Crate - %d m - %d o'clock\n", _fobCrate.dist, ctld_c.getClockDirection(_heli, _fobCrate.crateUnit))
        end
    end

    if _message ~= "" or _fobMsg ~= "" then

        local _txt = ""

        if _message ~= "" then
            _txt = "Nearby Crates:\n" .. _message
        end

        if _fobMsg ~= "" then

            if _message ~= "" then
                _txt = _txt .. "\n\n"
            end

            _txt = _txt .. "Nearby FOB Crates (Not Slingloadable):\n" .. _fobMsg
        end

        ctld_c.displayMessageToGroup(_heli, _txt, ctld_c.displayMessageTime)

    else
        --no crates nearby

        local _txt = "No Nearby Crates"

        ctld_c.displayMessageToGroup(_heli, _txt, ctld_c.displayMessageTime)
    end
end


function ctld_c.listFOBS(_args)

    local _msg = "FOB Positions:"

    local _heli = ctld_c.getTransportUnit(_args[1])

    if _heli == nil then

        return -- no heli!
    end

    -- get fob positions

    local _fobs = ctld_c.getSpawnedFobs(_heli)

    -- now check spawned fobs
    for _, _fob in ipairs(_fobs) do
        _msg = string.format("%s\nFOB @ %s", _msg, ctld_c.getFOBPositionString(_fob))
    end

    if _msg == "FOB Positions:" then
        ctld_c.displayMessageToGroup(_heli, "Sorry, there are no active FOBs!", ctld_c.displayMessageTime/2)
    else
        ctld_c.displayMessageToGroup(_heli, _msg, ctld_c.displayMessageTime*1.5)
    end
end

function ctld_c.getFOBPositionString(_fob)

    local _lat, _lon = coord.LOtoLL(_fob:getPosition().p)

    local _latLngStr = ctld_c.tostringLL(_lat, _lon, 3, false)

    local _message = _latLngStr

    local _beaconInfo = ctld_c.fobBeacons[_fob:getName()]

    if _beaconInfo ~= nil then
        _message = string.format("%s - %.2f KHz ", _message, _beaconInfo.vhf / 1000)
        --_message = string.format("%s - %.2f MHz ", _message, _beaconInfo.uhf / 1000000)
        --_message = string.format("%s - %.2f MHz ", _message, _beaconInfo.fm / 1000000)
    end

    return _message
end


function ctld_c.displayMessageToGroup(_unit, _text, _time,_clear)

    local _groupId = ctld_c.getGroupId(_unit)
    if _groupId then
        if _clear == true then
            trigger.action.outTextForGroup(_groupId, _text, _time,_clear)
        else
            trigger.action.outTextForGroup(_groupId, _text, _time)
        end
    end
end

