--includes fob crates!
function ctld_c.getCratesAndDistance(_heli, _distanceFilter)
    local _crates = {}

    local _allCrates
    if _heli:getCoalition() == 1 then
        _allCrates = ctld_c.spawnedCratesRED
    elseif _heli:getCoalition() == 2 then
        _allCrates = ctld_c.spawnedCratesBLUE
    else
        _allCrates = ctld_c.spawnedCratesNEUTRAL
    end

    for _crateName, _details in pairs(_allCrates) do
        --get crate
        local _crate = ctld_c.getCrateObject(_crateName)

        --in air seems buggy with crates so if in air is true, get the height above ground and the speed magnitude
        if _crate ~= nil and _crate:getLife() > 0
                and (ctld_c.inAir(_crate) == false) then

            local _dist = ctld_c.getDistance(_crate:getPoint(), _heli:getPoint())

            local proceed = false
            if _distanceFilter then
                if _dist <= _distanceFilter then
                    proceed = true
                end
            else
                proceed = true
            end


            if proceed then
                local _crateDetails = { crateUnit = _crate, dist = _dist, details = _details }
                table.insert(_crates, _crateDetails)
            end
        end
    end

    local _fobCrates
    if _heli:getCoalition() == 1 then
        _fobCrates = ctld_c.droppedFOBCratesRED
    elseif _heli:getCoalition() == 2 then
        _fobCrates = ctld_c.droppedFOBCratesBLUE
    else
        _fobCrates = ctld_c.droppedFOBCratesNEUTRAL
    end

    for _crateName, _details in pairs(_fobCrates) do

        --get crate
        local _crate = ctld_c.getCrateObject(_crateName)

        if _crate ~= nil and _crate:getLife() > 0 then

            local _dist = ctld_c.getDistance(_crate:getPoint(), _heli:getPoint())

            local _crateDetails = { crateUnit = _crate, dist = _dist, details = { unit = "FOB" }, }

            table.insert(_crates, _crateDetails)
        end
    end

    return _crates
    
end

function ctld_c.getClosestCrate(_heli, _crates, _type) -- does _heli is needed!?
    if _crates then
        if #_crates > 0 then
            local _closetCrate = nil
            local _shortestDistance = -1
            local _distance = 0

            for _, _crate in pairs(_crates) do

                if (_crate.details.unit == _type or _type == nil) then
                    _distance = _crate.dist

                    if _distance ~= nil and (_shortestDistance == -1 or _distance < _shortestDistance) then
                        _shortestDistance = _distance
                        _closetCrate = _crate
                    end
                end
            end

            return _closetCrate
        end
    end
end

function ctld_c.cleanAreaFromWreckage(_Crate)

    if _Crate and _Crate.crateUnit then
        local vec3 = _Crate.crateUnit:getPosition().p
        if vec3 then

            local _volume = {
                id = world.VolumeType.SPHERE,
                params = {
                    point = vec3,
                    radius = ctld_c.unpackTemplateDistance*2
                }
            }

            local _search = function(_static)
                pcall(function()
        
                    if _static ~= nil and _static:getLife() < 1 then
                        _static:destroy()
                        env.info("ctld_c cleanAreaFromWreckage: destroyed stati object cleaned out")
                    end
                end)
        
                return true
            end
            world.searchObjects(Object.Category.STATIC, _volume, _search)

        end
    end
end

function ctld_c.findNearestTemplate(_Heli, _Crate, _Template)

    local _templateParts = {}
    local _unitList = {}
    local _group = _Heli:getGroup()
    local _heliUnits = _group:getUnits()

    if _Crate and _Crate.crateUnit and _Template.parts then
        local vec3 = _Crate.crateUnit:getPosition().p
        local _coa = _Crate.crateUnit:getCoalition()
        if vec3 and _coa then

            local _volume = {
                id = world.VolumeType.SPHERE,
                params = {
                    point = vec3,
                    radius = ctld_c.unpackTemplateDistance*2
                }
            }

            for xId, xData in pairs (_Template.parts) do
                _templateParts[#_templateParts+1] = xData
            end
            env.info("ctld_c findNearestTemplate: _templateParts (initial) " .. tostring(#_templateParts))  

            -- count
            local _search = function(_unit, _coa)
                pcall(function()
        
                    if _unit ~= nil and _unit:getLife() > 0 and _unit:getCoalition() == _coa then

                        local halt = false -- this for preventing units from the "player" group to be rmoved XD
                        for tId, tData in pairs(_heliUnits) do
                            if _unit:getID() == tData:getID() then
                                halt = true
                            end
                        end

                        if not halt then
                            local _tempPoint = _unit:getPoint()
                            local _Type = _unit:getTypeName()
                            local _Point = { x = _tempPoint.x, y = _tempPoint.y, z = _tempPoint.z }

                            for pId, pData in pairs (_Template.parts) do
                                if _Type == pData.name then
                                    
                                    env.info("ctld_c findNearestTemplate: name: " .. tostring(pData.name))
                                    _unitList[#_unitList+1] = { u = _unit, t = _Type, p = _Point, l = pData.launcher} -- la conta dei lanciatori non funziona!!!!!!
                                    
                                    for dId, dData in pairs (_templateParts) do
                                        if dData.name == _Type then
                                            table.remove(_templateParts, dId)
                                        end
                                    end
                                    
                                end
                            end



                        end

                    end
                end)
        
                return true
            end
            world.searchObjects(Object.Category.UNIT, _volume, _search, _coa)
            
        end
    end

    local msg = ""
    env.info("ctld_c findNearestTemplate: _templateParts " .. tostring(#_templateParts))  
    env.info("ctld_c findNearestTemplate: _unitList " .. tostring(#_unitList))  
    
    if #_templateParts == 0 then
        damageRatio = 0
        msg = "No damaged group found"       
        env.info("ctld_c findNearestTemplate: No damaged group found"   )  
    elseif #_unitList > 0 and #_templateParts > 0 then
        env.info("ctld_c findNearestTemplate: returning parts"   ) 
        return _unitList, _Template
    else
        env.info("ctld_c findNearestTemplate: no templates found"   ) 
        return msg
    end
end

function ctld_c.getCrateObject(_name)
    local _crate

    if ctld_c.staticBugWorkaround then
        _crate  = Unit.getByName(_name)
    else
        _crate = StaticObject.getByName(_name)
    end

    return _crate
end

function ctld_c.unpackCrates(_arguments)

    local _status, _err = pcall(function(_args)

        -- trigger.action.outText("Unpack Crates".._args[1],10)

        local _heli = ctld_c.getTransportUnit(_args[1])

        if _heli ~= nil and ctld_c.inAir(_heli) == false then

            local _crates = ctld_c.getCratesAndDistance(_heli)
            local _crate = ctld_c.getClosestCrate(_heli, _crates)

            -- check unpackability (wow, new maccheroni word by me)
            if _crate.details.cantUnpack == true and _crate.details.obj_crate then
                ctld_c.displayMessageToGroup(_heli, "Nearest crate is an airlift resupply crate: those crates do not need to be unpacked.\nThe fuel-ammo delivery will take effect in the next mission.\n\n If you were trying to unpack something else, move yourself closer to the desired crate.", ctld_c.displayMessageTime)
                return
            end                

            -- check restrictions
			if ctld_c.unpackRestriction == true then
                
                if _crate ~= nil then
                    
                    if _crate.details.obj_crate == ctld_c.repairCrateModel and _crate.details.unit == "REPAIR-CRATE" then
                        env.info("ctld_c unpackCrates: crate is for repair, starting repairGroup")
                        ctld_c.displayMessageToGroup(_heli, "Repair process has been planned, estimated time to complete: " .. tostring(ctld_c.repairDelay) .. " minutes", ctld_c.displayMessageTime/2)
                        local function doRepair()
                            ctld_c.repairByCrate(_heli, _crate)
                        end
                        timer.scheduleFunction(doRepair, nil, timer.getTime() + (ctld_c.repairDelay*60))
                        return  
                    end
                    
                    if _crate.details.movers == true then
                        if ctld_c.nearEnoughFromWarehouse(_heli) == false then
                            ctld_c.displayMessageToGroup(_heli, "You can't unpack that here! Take it nearby a warehouse or ammunition deposit!", ctld_c.displayMessageTime)
                            return
                        end
                    else
                        if debugProcessDetail then
                            env.info("ctld_c unpackCrates: ctld_c.inLogisticsZone " .. tostring(ctld_c.inLogisticsZone(_heli)))
                            env.info("ctld_c unpackCrates: ctld_c.farEnoughFromLogisticZone " .. tostring(ctld_c.farEnoughFromLogisticZone(_heli)))
                        end	
                        if ctld_c.inLogisticsZone(_heli) == true  or  ctld_c.farEnoughFromLogisticZone(_heli) == false then
                            if debugProcessDetail then
                                env.info("ctld_c unpackCrates: wrong variable set, can't unpack")
                            end
                            ctld_c.displayMessageToGroup(_heli, "You can't unpack that here! Take it to where it's needed!", ctld_c.displayMessageTime)
                            return
                        end
                    end

                else
                    ctld_c.displayMessageToGroup(_heli,"No crates identified", ctld_c.displayMessageTime/2)
                    return
                end
			end

            if _crate ~= nil and _crate.dist < ctld_c.unpackTemplateDistance and (_crate.details.unit == "FOB" or _crate.details.unit == "FOB-SMALL") then

                if debugProcessDetail then
                    env.info("ctld_c unpackCrates: crate is a FOB crate, unpacking")
                end
                ctld_c.unpackFOBCrates(_crates, _heli)

                return


            elseif _crate ~= nil and _crate.dist < ctld_c.unpackCrateDistance then 

                if debugProcessDetail then
                    env.info("ctld_c unpackCrates: crate is not a fob crate")
                end

                if ctld_c.forceCrateToBeMoved == true then
					
                    if debugProcessDetail then
                        env.info("ctld_c unpackCrates: requiring original position check")
                    end

					if ctld_c.crateInitPos[_crate.crateUnit:getName()] then

                        if debugProcessDetail then
                            env.info("ctld_c unpackCrates: crate original position found")
                        end

                        local preData = ctld_c.crateInitPos[_crate.crateUnit:getName()]
						local curPos = _crate.crateUnit:getPosition().p
                        
                        if preData == curPos then
                            if debugProcessDetail then
                                env.info("ctld_c unpackCrates: position of the crate in ctld_c.crateInitPos is the same, can't unpack")
                            end
                            ctld_c.displayMessageToGroup(_heli,"Sorry you must move this crate before you unpack it!", ctld_c.displayMessageTime/2)
                            return
                        end

                        if debugProcessDetail then
                            env.info("ctld_c unpackCrates: crate original position is changed, filter passed")
                        end

					end
                end

                local _Template = ctld_c.getCustomTemplate(_crate.details.weight)
                --local _farpTemplate = ctld_c.getFARPTemplate(_crate.details.weight)
                env.info(("DSMC unpackCrates weight: " ..  tostring(_crate.details.weight)))

                if _Template then
                    
                    if debugProcessDetail then
                        env.info("ctld_c unpackCrates: template found, unpacking")
                    end

                    ctld_c.unpackTemplate(_heli, _crate, _crates,_Template)
                    return -- stop processing

                elseif _crate.details.cratesRequired ~= nil and _crate.details.cratesRequired > 1 then
                    -- multicrate

                    if debugProcessDetail then
                        env.info("ctld_c unpackCrates: template not found, multicrate unpack attempt")
                    end

                    ctld_c.unpackMultiCrate(_heli, _crate, _crates)

                    return

                else

                    if debugProcessDetail then
                        env.info("ctld_c unpackCrates: single crate")
                    end

                    -- single crate
                    local _cratePoint = _crate.crateUnit:getPoint()
                    local _crateName = _crate.crateUnit:getName()

                    -- ctld_c.spawnCrateStatic( _heli:getCoalition(),ctld_c.getNextUnitId(),{x=100,z=100},_crateName,100)
                    if debugProcessDetail then
                        env.info("ctld_c unpackCrates: _cratePoint " .. tostring(_cratePoint))
                        env.info("ctld_c unpackCrates: _crateName " .. tostring(_crateName))
                    end

                    _crate.crateUnit:destroy()
                    if debugProcessDetail then
                        env.info("ctld_c unpackCrates: crate deleted")
                    end

                    local _spawnedGroups = ctld_c.spawnCrateGroup(_heli, { _cratePoint }, { _crate.details.unit })

                    if _heli:getCoalition() == 1 then
                        ctld_c.spawnedCratesRED[_crateName] = nil
                    elseif _heli:getCoalition() == 2 then
                        ctld_c.spawnedCratesBLUE[_crateName] = nil
                    else
                        ctld_c.spawnedCratesNEUTRAL[_crateName] = nil
                    end

                    ctld_c.processCallback({unit = _heli, crate = _crate , spawnedGroup = _spawnedGroups, action = "unpack"})

                    if _crate.details.unit == "1L13 EWR" then
                        ctld_c.addEWRTask(_spawnedGroups)

                        --       env.info("Added EWR")
                    end


                    trigger.action.outTextForCoalition(_heli:getCoalition(), ctld_c.getPlayerNameOrType(_heli) .. " successfully deployed " .. _crate.details.desc .. " to the field", ctld_c.displayMessageTime/2)

                    if ctld_c.isJTACUnitType(_crate.details.unit) and ctld_c.JTAC_dropEnabled then
						local _side = _heli:getCoalition()
                        local _code = ctld_c.jtacGetLaserCodeBySide(_side)					

                        ctld_c.CreateJTAC(_spawnedGroups:getName(), _code)
                        ctld_c.addRETURNFIREOption(_spawnedGroups)
                    end
                end

            else

                ctld_c.displayMessageToGroup(_heli, "No friendly crates close enough to unpack", ctld_c.displayMessageTime/2)
            end
        end
    end, _arguments)

    if (not _status) then
        env.error(string.format("ctld_c ERROR: %s", _err))
    end
end


-- builds a fob!
function ctld_c.unpackFOBCrates(_crates, _heli)
	
	if ctld_c.unpackRestriction == true then
		if ctld_c.inLogisticsZone(_heli) == true then
			ctld_c.displayMessageToGroup(_heli, "You can't unpack that here! Take it to where it's needed!", 20)
			return
		end
	end

    -- unpack multi crate
    local _nearbyMultiCrates = {}

    local _bigFobCrates = 0
    local _smallFobCrates = 0
    local _totalCrates = 0

    for _, _nearbyCrate in pairs(_crates) do

        if _nearbyCrate.dist < 750  then

            if  _nearbyCrate.details.unit == "FOB" then
                _bigFobCrates = _bigFobCrates + 1
                table.insert(_nearbyMultiCrates, _nearbyCrate)
            elseif _nearbyCrate.details.unit == "FOB-SMALL" then
                _smallFobCrates = _smallFobCrates + 1
                table.insert(_nearbyMultiCrates, _nearbyCrate)
            end

            --catch divide by 0
            if _smallFobCrates > 0 then
                _totalCrates = _bigFobCrates + (_smallFobCrates/ctld_c.crateLargeToSmallRatio)
            else
                _totalCrates = _bigFobCrates
            end

            if _totalCrates >= ctld_c.cratesRequiredForFOB then
                break
            end
        end
    end

    --- check crate count
    if _totalCrates >= ctld_c.cratesRequiredForFOB then

        -- destroy crates

        local _points = {}

        for _, _crate in pairs(_nearbyMultiCrates) do

            if _heli:getCoalition() == 1 then
                ctld_c.droppedFOBCratesRED[_crate.crateUnit:getName()] = nil
                ctld_c.spawnedCratesRED[_crate.crateUnit:getName()] = nil
            elseif _heli:getCoalition() == 2 then
                ctld_c.droppedFOBCratesBLUE[_crate.crateUnit:getName()] = nil
                ctld_c.spawnedCratesBLUE[_crate.crateUnit:getName()] = nil
            else
                ctld_c.droppedFOBCratesNEUTRAL[_crate.crateUnit:getName()] = nil
                ctld_c.spawnedCratesNEUTRAL[_crate.crateUnit:getName()] = nil                
            end

            table.insert(_points, _crate.crateUnit:getPoint())

            --destroy
            _crate.crateUnit:destroy()
        end

        local _centroid = ctld_c.getCentroid(_points)

        timer.scheduleFunction(function(_args)

            local _unitId = ctld_c.getNextUnitId()
            local _name = "Deployed FOB #" .. _unitId

            local _fob = ctld_c.spawnFOB(_args[2], _unitId, _args[1], _name)

            --make it able to deploy crates
            table.insert(ctld_c.logisticUnits, _fob:getName())

            ctld_c.beaconCount = ctld_c.beaconCount + 1

            local _radioBeaconName = "FOB Beacon #" .. ctld_c.beaconCount

            local _radioBeaconDetails = ctld_c.createRadioBeacon(_args[1], _args[3], _args[2], _radioBeaconName, nil, true)

            ctld_c.fobBeacons[_name] = { vhf = _radioBeaconDetails.vhf } -- , uhf = _radioBeaconDetails.uhf , fm = _radioBeaconDetails.fm

            if ctld_c.troopPickupAtFOB == true then

                table.insert(ctld_c.builtFOBS, _fob:getName())

                trigger.action.outTextForCoalition(_args[3], "Finished building FOB! Crates and Troops can now be picked up.", ctld_c.displayMessageTime/2)
            else
                trigger.action.outTextForCoalition(_args[3], "Finished building FOB! Crates can now be picked up.", ctld_c.displayMessageTime/2)
            end
        end, { _centroid, _heli:getCountry(), _heli:getCoalition() }, timer.getTime() + ctld_c.buildTimeFOB)

        local _txt = string.format("%s started building FOB using %d FOB crates, it will be finished in %d seconds.\nPosition marked with smoke.", ctld_c.getPlayerNameOrType(_heli), _totalCrates, ctld_c.buildTimeFOB)

        ctld_c.processCallback({unit = _heli, position = _centroid, action = "fob"})

        trigger.action.smoke(_centroid, trigger.smokeColor.Green)

        trigger.action.outTextForCoalition(_heli:getCoalition(), _txt, ctld_c.displayMessageTime/2)
    else
        local _txt = string.format("Cannot build FOB!\n\nIt requires %d Large FOB crates ( %d small FOB crates equal 1 large FOB Crate) and there are the equivalent of %d large FOB crates nearby\n\nOr the crates are not within 750m of each other", ctld_c.cratesRequiredForFOB, ctld_c.crateLargeToSmallRatio, _totalCrates)
        ctld_c.displayMessageToGroup(_heli, _txt, ctld_c.displayMessageTime)
    end
end

-- ADD DSMC
function ctld_c.dropMultyCrate(_args)

    local _unit = ctld_c.getTransportUnit(_args[1])

    if _unit:hasAttribute("APC") or _unit:hasAttribute("IFV") or _unit:hasAttribute("Trucks") then
        local _group = _unit:getGroup()
        if _group then
            local _units = _group:getUnits()
            if _units then
                for _, uData in pairs(_units) do
                    local uName = uData:getName()
                    env.info("DSMC dropMultyCrate uName: " .. tostring(uName))
                    ctld_c.dropSlingCrate({ uName })
                end
            else
                env.info("DSMC dropMultyCrate _units missing")
            end
        else
            env.info("DSMC dropMultyCrate _group missing")
        end
    else
        env.info("DSMC dropMultyCrate is a plane-helo")
        ctld_c.dropSlingCrate(_args)
    end
end



--unloads the sling crate when the helicopter is on the ground or between 4.5 - 10 meters
function ctld_c.dropSlingCrate(_args)
    local _heli = ctld_c.getTransportUnit(_args[1])

    if _heli == nil then
        return -- no heli!
    end

    local _currentCrate = ctld_c.inTransitSlingLoadCrates[_heli:getName()]

    if _currentCrate == nil then

        ctld_c.displayMessageToGroup(_heli, "You are not currently transporting any crates. \n\nTo Pickup a crate - land and use F10 Crate Commands to load one.", ctld_c.displayMessageTime/2)

    else

        local _heli = ctld_c.getTransportUnit(_args[1])

        local _point = _heli:getPoint()

        local _unitId = ctld_c.getNextUnitId()

        local _side = _heli:getCoalition()

        local _name = string.format("%s #%i", _currentCrate.desc, _unitId)


        local _heightDiff = ctld_c.heightDiff(_heli)

        if ctld_c.inAir(_heli) == false or _heightDiff <= 7.5 then
            ctld_c.displayMessageToGroup(_heli, _currentCrate.desc .. " crate has been safely unhooked and is at your 12 o'clock", ctld_c.displayMessageTime/2)
            _point = ctld_c.getPointAt12Oclock(_heli, 30)
            --        elseif _heightDiff > 40.0 then
            --            ctld_c.inTransitSlingLoadCrates[_heli:getName()] = nil
            --            ctld_c.displayMessageToGroup(_heli, "You were too high! The crate has been destroyed", 10)
            --            return
        elseif _heightDiff > 7.5 and _heightDiff <= 40.0 then
            ctld_c.displayMessageToGroup(_heli, _currentCrate.desc .. " crate has been safely dropped below you", ctld_c.displayMessageTime/2)
        else -- _heightDiff > 40.0
        ctld_c.inTransitSlingLoadCrates[_heli:getName()] = nil
        ctld_c.displayMessageToGroup(_heli, "You were too high! The crate has been destroyed", ctld_c.displayMessageTime/2)
        return
        end


        --remove crate from cargo
        ctld_c.inTransitSlingLoadCrates[_heli:getName()] = nil
		
		local _weightkg = ctld_c.checkInternalWeight(_heli)
		local _weightlbs = math.floor(_weightkg * 2.20462)
		trigger.action.setUnitInternalCargo(_heli:getName(), _weightkg )
		ctld_c.displayMessageToGroup(_heli, "Your internal cargo weight is now ".. _weightkg .. "kg/" .. _weightlbs .. "lbs", ctld_c.displayMessageTime, false)
			
        local _spawnedCrate = ctld_c.spawnCrateStatic(_heli:getCountry(), _unitId, _point, _name, _currentCrate.weight,_side, _currentCrate.obj_crate)
    end
end

-- shows the status of the current simulated cargo status
function ctld_c.slingCargoStatus(_args)
    local _heli = ctld_c.getTransportUnit(_args[1])

    if _heli == nil then
        return -- no heli!
    end

    local _currentCrate = ctld_c.inTransitSlingLoadCrates[_heli:getName()]

    if _currentCrate == nil then
        ctld_c.displayMessageToGroup(_heli, "You are not currently transporting any crates. \n\nTo Pickup a crate, land near the crate and load it using the menu", ctld_c.displayMessageTime/2)
    else
        ctld_c.displayMessageToGroup(_heli, "Currently Transporting: " .. _currentCrate.desc --[[.. " \n\nTo Pickup a crate, hover for 10 seconds above the crate"]], ctld_c.displayMessageTime/2)
    end
end

--spawns a radio beacon made up of two units,
-- one for VHF and one for UHF
-- The units are set to to NOT engage
function ctld_c.createRadioBeacon(_point, _coalition, _country, _name, _batteryTime, _isFOB)
    --env.info("DSMC createRadioBeacon spawning vhf")
    --local _uhfGroup = ctld_c.spawnRadioBeaconUnit(_point, _country, "UHF")
    local _vhfGroup = ctld_c.spawnRadioBeaconUnit(_point, _country, "VHF")
    --local _fmGroup = ctld_c.spawnRadioBeaconUnit(_point, _country, "FM")
    --env.info("DSMC createRadioBeacon spawned vhf")
    local _freq = ctld_c.generateADFFrequencies()
    --env.info("DSMC createRadioBeacon generated freq")
    --create timeout
    local _battery

    if _batteryTime == nil then
        _battery = timer.getTime() + (ctld_c.deployedBeaconBattery * 60)
    else
        _battery = timer.getTime() + (_batteryTime * 60)
    end

    local _lat, _lon = coord.LOtoLL(_point)

    local _latLngStr = ctld_c.tostringLL(_lat, _lon, 3, false)

    local _message = _name

    if _isFOB then
        --  _message = "FOB " .. _message
        _battery = -1 --never run out of power!
    end

    _message = _message .. " - " .. _latLngStr

    --  env.info("GEN UHF: ".. _freq.uhf)
    --  env.info("GEN VHF: ".. _freq.vhf)

    _message = string.format("%s - %.3f KHz", _message, _freq.vhf / 1000)

    --_message = string.format("%s - %.2f MHz", _message, _freq.uhf / 1000000)

    -- _message = string.format("%s - %.2f MHz ", _message, _freq.fm / 1000000)



    local _beaconDetails = {
        vhf = _freq.vhf,
        vhfGroup = _vhfGroup:getName(),
        --uhf = _freq.uhf,
        --uhfGroup = _uhfGroup:getName(),
        --fm = _freq.fm,
        --fmGroup = _fmGroup:getName(),
        text = _message,
        battery = _battery,
        coalition = _coalition,
    }
    --env.info("DSMC createRadioBeacon update beacon")
    ctld_c.updateRadioBeacon(_beaconDetails)
    --env.info("DSMC createRadioBeacon updated beacon")
    table.insert(ctld_c.deployedRadioBeacons, _beaconDetails)

    return _beaconDetails
end

