function ctld_c.updateRadioBeacon(_beaconDetails)
    --dumpTable("_beaconDetails.lua", _beaconDetails)

    local _vhfGroup = Group.getByName(_beaconDetails.vhfGroup)

    --local _uhfGroup = Group.getByName(_beaconDetails.uhfGroup)

    --local _fmGroup = Group.getByName(_beaconDetails.fmGroup)

    local _radioLoop = {}

    if _vhfGroup ~= nil and _vhfGroup:getUnits() ~= nil and #_vhfGroup:getUnits() == 1 then
        table.insert(_radioLoop, { group = _vhfGroup, freq = _beaconDetails.vhf, silent = false, mode = 0 })
    end

    --if _uhfGroup ~= nil and _uhfGroup:getUnits() ~= nil and #_uhfGroup:getUnits() == 1 then
    --    table.insert(_radioLoop, { group = _uhfGroup, freq = _beaconDetails.uhf, silent = true, mode = 0 })
    --end

    --if _fmGroup ~= nil and _fmGroup:getUnits() ~= nil and #_fmGroup:getUnits() == 1 then
    --    table.insert(_radioLoop, { group = _fmGroup, freq = _beaconDetails.fm, silent = false, mode = 1 })
    --end

    local _batLife = _beaconDetails.battery - timer.getTime()

    if (_batLife <= 0 and _beaconDetails.battery ~= -1) or #_radioLoop ~= 1 then
        -- ran out of batteries

        if _vhfGroup ~= nil then
            _vhfGroup:destroy()
        end
        --if _uhfGroup ~= nil then
        --    _uhfGroup:destroy()
        --end
        --if _fmGroup ~= nil then
        --    _fmGroup:destroy()
        --end

        return false
    end

    --fobs have unlimited battery life
    --    if _battery ~= -1 then
    --        _text = _text.." "..ctld_c.round(_batLife).." seconds of battery"
    --    end

    for _, _radio in pairs(_radioLoop) do

        local _groupController = _radio.group:getController()

        local _sound = ctld_c.radioSound
        if _radio.silent then
            _sound = ctld_c.radioSoundFC3
        end

        _sound = "l10n/DEFAULT/".._sound

        _groupController:setOption(AI.Option.Ground.id.ROE, AI.Option.Ground.val.ROE.WEAPON_HOLD)

        trigger.action.radioTransmission(_sound, _radio.group:getUnit(1):getPoint(), _radio.mode, false, _radio.freq, 1000)
        --This function doesnt actually stop transmitting when then sound is false. My hope is it will stop if a new beacon is created on the same
        -- frequency... OR they fix the bug where it wont stop.
        --        end

        --
    end

    return true

    --  trigger.action.radioTransmission(ctld_c.radioSound, _point, 1, true, _frequency, 1000)
end

function ctld_c.listRadioBeacons(_args)

    local _heli = ctld_c.getTransportUnit(_args[1])
    local _message = ""

    if _heli ~= nil then

        for _x, _details in pairs(ctld_c.deployedRadioBeacons) do

            if _details.coalition == _heli:getCoalition() then
                _message = _message .. _details.text .. "\n"
            end
        end

        if _message ~= "" then
            ctld_c.displayMessageToGroup(_heli, "Radio Beacons:\n" .. _message, ctld_c.displayMessageTime)
        else
            ctld_c.displayMessageToGroup(_heli, "No Active Radio Beacons", ctld_c.displayMessageTime)
        end
    end
end

function ctld_c.dropRadioBeacon(_args)

    local _heli = ctld_c.getTransportUnit(_args[1])
    local _message = ""

    if _heli ~= nil and ctld_c.inAir(_heli) == false then

        --deploy 50 m infront
        --try to spawn at 12 oclock to us
        local _point = ctld_c.getPointAt12Oclock(_heli, 50)

        ctld_c.beaconCount = ctld_c.beaconCount + 1
        local _name = "Beacon #" .. ctld_c.beaconCount

        local _radioBeaconDetails = ctld_c.createRadioBeacon(_point, _heli:getCoalition(), _heli:getCountry(), _name, nil, false)

        -- mark with flare?

        trigger.action.outTextForCoalition(_heli:getCoalition(), ctld_c.getPlayerNameOrType(_heli) .. " deployed a Radio Beacon.\n\n" .. _radioBeaconDetails.text, ctld_c.displayMessageTime)

    else
        ctld_c.displayMessageToGroup(_heli, "You need to land before you can deploy a Radio Beacon!", ctld_c.displayMessageTime)
    end
end

--remove closet radio beacon
function ctld_c.removeRadioBeacon(_args)

    local _heli = ctld_c.getTransportUnit(_args[1])
    local _message = ""

    if _heli ~= nil and ctld_c.inAir(_heli) == false then

        -- mark with flare?

        local _closetBeacon = nil
        local _shortestDistance = -1
        local _distance = 0

        for _x, _details in pairs(ctld_c.deployedRadioBeacons) do

            if _details.coalition == _heli:getCoalition() then

                local _group = Group.getByName(_details.vhfGroup)

                if _group ~= nil and #_group:getUnits() == 1 then

                    _distance = ctld_c.getDistance(_heli:getPoint(), _group:getUnit(1):getPoint())
                    if _distance ~= nil and (_shortestDistance == -1 or _distance < _shortestDistance) then
                        _shortestDistance = _distance
                        _closetBeacon = _details
                    end
                end
            end
        end

        if _closetBeacon ~= nil and _shortestDistance then
            local _vhfGroup = Group.getByName(_closetBeacon.vhfGroup)

            --local _uhfGroup = Group.getByName(_closetBeacon.uhfGroup)

            local _fmGroup = Group.getByName(_closetBeacon.fmGroup)

            if _vhfGroup ~= nil then
                _vhfGroup:destroy()
            end
            --if _uhfGroup ~= nil then
            --    _uhfGroup:destroy()
            --end
            if _fmGroup ~= nil then
                _fmGroup:destroy()
            end

            trigger.action.outTextForCoalition(_heli:getCoalition(), ctld_c.getPlayerNameOrType(_heli) .. " removed a Radio Beacon.\n\n" .. _closetBeacon.text, ctld_c.displayMessageTime/2)
        else
            ctld_c.displayMessageToGroup(_heli, "No Radio Beacons within 500m.", ctld_c.displayMessageTime)
        end

    else
        ctld_c.displayMessageToGroup(_heli, "You need to land before remove a Radio Beacon", ctld_c.displayMessageTime)
    end
end

-- gets the center of a bunch of points!
-- return proper DCS point with height
function ctld_c.getCentroid(_points)
    local _tx, _ty = 0, 0
    for _index, _point in ipairs(_points) do
        _tx = _tx + _point.x
        _ty = _ty + _point.z
    end

    local _npoints = #_points

    local _point = { x = _tx / _npoints, z = _ty / _npoints }

    _point.y = land.getHeight({ _point.x, _point.z })

    return _point
end

function ctld_c.getCustomTemplate(_crateWeight)

    for _,_system in pairs(ctld_c.specificTemplate) do

        --if _system.repair == _unitName then
        --    return _system
        --end

        for _,_part in pairs(_system.parts) do

            if _crateWeight == _part.wht  then
                return _system
            end
        end
    end

    return nil

end

function ctld_c.getLauncherUnitFromAATemplate(_aaTemplate)
    for _,_part in pairs(_aaTemplate.parts) do

        if _part.launcher then
            return _part.name
        end
    end

    return nil
end

function ctld_c.getCustomTemplateDetails(_customTemplateGroup,_CustomTemplate)

    local _units = _customTemplateGroup:getUnits()

    local _templateDetails = {}

    for _, _unit in pairs(_units) do
        table.insert(_templateDetails, { point = _unit:getPoint(), unit = _unit:getTypeName(), name = _unit:getName(), system =_CustomTemplate})
    end

    return _templateDetails
end

function ctld_c.countTableEntries(_table)

    if _table == nil then
        return 0
    end


    local _count = 0

    for _key, _value in pairs(_table) do

        _count = _count + 1
    end

    return _count
end

function ctld_c.unpackTemplate(_heli, _nearestCrate, _nearbyCrates, _CustomTemplate)

    --if ctld_c.rearmAASystem(_heli, _nearestCrate, _nearbyCrates,_CustomTemplate) then
    --      -- rearmed hawk
    --      return
    --      env.info(ctld_c.pickupZones[_index][1].." = " ..ctld_c.pickupZones[_index][3])
    --end

    env.info("DSMC unpackTemplate: trying to found template of " .. tostring(_CustomTemplate.name))

    -- are there all the pieces close enough together
    local _systemParts = {}
    local _longRange = _CustomTemplate.longrange
    --initialise list of parts

    for _,_part in pairs(_CustomTemplate.parts) do
        _systemParts[_part.name] = {name = _part.name, desc = _part.desc, found = false, ln = _part.launcher}
        env.info("DSMC unpackTemplate: _systemParts added " .. tostring(_part.name))
    end

    -- find all nearest crates and add them to the list if they're part of the AA System -- QUIII
    local _lnPart = 0

    local killCratesTable = {}
    for _, _nearbyCrate in pairs(_nearbyCrates) do

        if _nearbyCrate.dist < ctld_c.unpackTemplateDistance then

            env.info("DSMC unpackTemplate: _nearbyCrate details.unit " .. tostring(_nearbyCrate.details.unit))

            if _systemParts[_nearbyCrate.details.unit] ~= nil then
                local proceed = false
                if _nearbyCrate.details.isLauncher then
                    _lnPart = _lnPart + 1
                    proceed = true
                else
                    if _systemParts[_nearbyCrate.details.unit].found == false then
                        proceed = true
                    end
                end                
                env.info("DSMC unpackTemplate: proceed " .. tostring(proceed))

                if proceed then
                    killCratesTable[#killCratesTable+1] = _nearbyCrate.crateUnit
                    local _foundPart = _systemParts[_nearbyCrate.details.unit]
                    _foundPart.found = true
                    _foundPart.crate = _nearbyCrate
                    _systemParts[_nearbyCrate.details.unit] = _foundPart
                    env.info("DSMC unpackTemplate: _systemParts: added part " .. tostring(_nearbyCrate.details.unit))
                end
            end
        end
    end

    local _count = 0
    local _txt = ""

    local _posArray = {}
    local _typeArray = {}

    env.info("DSMC unpackTemplate: _lnPart: " .. tostring(_lnPart))
    if _longRange == true then
        if _lnPart < 6 then
            _txt = _txt .. "insufficient launchers for long range sam, required at least 6 launcher crates"
        end
    end

    for _name, _systemPart in pairs(_systemParts) do
        env.info("DSMC unpackTemplate: _systemPart: adding _name " .. tostring(_name))

        if _systemPart.found == false then
            _txt = _txt.."Missing ".._systemPart.desc.."\n"
            env.info("DSMC unpackTemplate: _systemPart: part missing")
        else

            local _launcherPart = ctld_c.getLauncherUnitFromAATemplate(_CustomTemplate)

            --handle multiple launchers from one crate
            if (_launcherPart == _name and ctld_c.aaLaunchers  > 1) then

                --add multiple launcher
                local _launchers = nil
                if _longRange == true then
                    _launchers = _lnPart
                else
                    _launchers = ctld_c.aaLaunchers + _lnPart - 1
                end

                for _i = 1, _launchers do

                    -- spawn in a circle around the crate
                    local _angle = math.pi * 2 * (_i - 1) / _launchers
                    local _xOffset = math.cos(_angle) * 20
                    local _yOffset = math.sin(_angle) * 20

                    local _point = _systemPart.crate.crateUnit:getPoint()

                    _point = { x = _point.x + _xOffset, y = _point.y, z = _point.z + _yOffset }

                    table.insert(_posArray, _point)
                    table.insert(_typeArray, _name)
                    env.info("DSMC unpackTemplate: _systemPart: inserted launcher")
                end
            else
                table.insert(_posArray, _systemPart.crate.crateUnit:getPoint())
                table.insert(_typeArray, _name)
                env.info("DSMC unpackTemplate: _systemPart: inserted something else")
            end
        end
    end

    local _activeSAM_site = ctld_c.countCompleteAASystems(_heli)

    local _allowed = ctld_c.SAM_site_limit

    --env.info("Active: ".._activeSAM_site.." Allowed: ".._allowed)

    if _activeSAM_site + 1 > _allowed then
        trigger.action.outTextForCoalition(_heli:getCoalition(), "Out of parts for SAM sites. Current limit is ".._allowed.." \n", ctld_c.displayMessageTime/2)
        env.info("DSMC unpackTemplate: too many sams out there, stopping")
        return
    end

    if _txt ~= ""  then
        ctld_c.displayMessageToGroup(_heli, "Cannot build ".._CustomTemplate.name.."\n" .. _txt .. "\n\nOr the crates are not close enough together", ctld_c.displayMessageTime/2)
        env.info("DSMC unpackTemplate: Cannot build ".._CustomTemplate.name.."\n" .. _txt .. "\n\nOr the crates are not close enough together")
        return
    else

        -- destroy crates
        for _, crateUnit in pairs(killCratesTable) do
            if crateUnit then
                if _heli:getCoalition() == 1 then
                    ctld_c.spawnedCratesRED[crateUnit:getName()] = nil
                elseif _heli:getCoalition() == 2 then
                    ctld_c.spawnedCratesBLUE[crateUnit:getName()] = nil
                else
                    ctld_c.spawnedCratesNEUTRAL[crateUnit:getName()] = nil
                end                

                if tblDeadUnits then
                    tblDeadUnits[#tblDeadUnits + 1] = {unitId = crateUnit:getID(), objCategory = 6}
                end                

                crateUnit:destroy()
            end
        end


        --[[
        for _name, _systemPart in pairs(_systemParts) do

            if _heli:getCoalition() == 1 then
                ctld_c.spawnedCratesRED[_systemPart.crate.crateUnit:getName()] = nil
            elseif _heli:getCoalition() == 2 then
                ctld_c.spawnedCratesBLUE[_systemPart.crate.crateUnit:getName()] = nil
            else
                ctld_c.spawnedCratesNEUTRAL[_systemPart.crate.crateUnit:getName()] = nil
            end

            -- DSMC addition to track old crates
            if tblDeadUnits then
                tblDeadUnits[#tblDeadUnits + 1] = {unitId = _systemPart.crate.crateUnit:getID(), objCategory = 6}
            end
            _systemPart.crate.crateUnit:destroy()

        end
        --]]--

        -- HAWK / BUK READY!
        local _spawnedGroup = ctld_c.spawnCrateGroup(_heli, _posArray, _typeArray)

        ctld_c.completedTemplate[_spawnedGroup:getName()] = ctld_c.getCustomTemplateDetails(_spawnedGroup,_CustomTemplate)

        ctld_c.processCallback({unit = _heli, crate = _nearestCrate , spawnedGroup = _spawnedGroup, action = "unpack"})

        trigger.action.outTextForCoalition(_heli:getCoalition(), ctld_c.getPlayerNameOrType(_heli) .. " successfully deployed a full ".._CustomTemplate.name.." to the field. \n\nSAM site limit is: ".._allowed.."\nActive: "..(_activeSAM_site+1), ctld_c.displayMessageTime/2)

    end
end

function ctld_c.countCompleteAASystems(_heli)     -- MODIFY TO CHECK SAMS!!!

    local _count = 0

    for _groupName, _templateDetails in pairs(ctld_c.completedTemplate) do

        local _hawkGroup = Group.getByName(_groupName)

        if _hawkGroup ~= nil and _hawkGroup:getCoalition() == _heli:getCoalition() then

            local _units = _hawkGroup:getUnits()
            local _isSamSite = false
            if ctld_c.countTableEntries(_units) > 0 then
                for _, _unit in pairs(_units) do
                    if _unit:hasAttribute("SAM LL") then
                        _isSamSite = true
                    end
                end
            end

            if _isSamSite == true then
                _count = _count +1
            end
        end
    end

    return _count
end

function ctld_c.repairByCrate(_heli, _crate)

    if _crate and _heli then
        local nogroup = false
        for _,  templateData in pairs(ctld_c.specificTemplate) do -- WUIII
            env.info("ctld_c repairByCrate: chcking template " .. tostring(templateData.name))

            local units, template = ctld_c.findNearestTemplate(_heli, _crate, templateData)
            if type(units) == "string" then
                nogroup = true
            elseif type(units) == "table" and template then

                -- remove existing dead units
                for _, uData in pairs (units) do
                    if uData.u then
                        local uObj = uData.u
                        local uLife = uObj:getLife()
                        if uLife > 1 then
                            uObj:destroy()


                            -- add necessary to track unit dead also in DSMC
                            if tblDeadUnits then
                                tblDeadUnits[#tblDeadUnits + 1] = {unitId = uObj:getID(), objCategory = 1}
                            end

                        end
                    end
                end

                -- spawn new one
                local nUtbl = ctld_c.deepCopy(template.parts)

                local primaPos = nil
                for pId, pData in pairs(nUtbl) do
                    for uId, uData in pairs(units) do
                        if pData.name == uData.t then
                            pData.pos = uData.p
                            pData.launcher = uData.l
                            primaPos = uData.p
                            env.info("ctld_c repairByCrate: added identified pos to unit " .. tostring(pData.name))
                        end
                    end
                end

                -- recycle to assign missing position
                local missingPos = 0
                if primaPos then
                    if primaPos.x and primaPos.y and primaPos.z then
                        for pId, pData in pairs(nUtbl) do
                            if not pData.pos then
                                missingPos = missingPos + 1
                                env.info("ctld_c repairByCrate: identified missing position for " .. tostring(pData.name))
                            end
                        end
                    end
                end

                if missingPos > 0 then

                    local pTbl = {}
                    for _i = 1, missingPos do
                        local _angle = math.pi * 2 * (_i - 1) / missingPos
                        local _xOffset = math.cos(_angle) * 12
                        local _yOffset = math.sin(_angle) * 12

                        local _point = primaPos
                        _point = { x = _point.x + _xOffset, y = _point.y, z = _point.z + _yOffset }
                        pTbl[_i] = _point
                        --table.insert(pTbl, _point)
                    end

                    -- riaggiungi punti
                    local ix = 1
                    for pId, pData in pairs(nUtbl) do
                        if not pData.pos then
                            pData.pos = pTbl[ix]
                            ix = ix + 1
                            env.info("ctld_c repairByCrate: added new pos to unit " .. tostring(pData.name))
                        end
                    end

                    -- built group table
                    local _posArray = {}
                    local _typeArray = {}
                    local errorcheck = false
                    for pId, pData in pairs(nUtbl) do
                        if pData.pos and pData.name then
                            if pData.launcher then

                                for _i = 1, 3 do
                                    local _angle = math.pi * 2 * (_i - 1) / 3
                                    local _xOffset = math.cos(_angle) * 12
                                    local _yOffset = math.sin(_angle) * 12
                
                                    --local _point = { x = _point.x + _xOffset, y = _point.y, z = _point.z + _yOffset }
                                    local _dePos = { x = pData.pos.x + _xOffset, y = pData.pos.y, z = pData.pos.z + _yOffset }
                                    
                                    table.insert(_posArray, _dePos)
                                    table.insert(_typeArray, pData.name)    
                                end

                            else
                                env.info("ctld_c repairByCrate: added toarray data for unit " .. tostring(pData.name))
                                table.insert(_posArray, pData.pos)
                                table.insert(_typeArray, pData.name)    
                            end
                        else
                            env.info("ctld_c repairByCrate: missing data of pos or t for arrays, unit: " .. tostring(pData.name))
                            errorcheck = true              
                        end
                    end


                    -- exec
                    if not errorcheck then

                        -- remove wreckage if present
                        ctld_c.cleanAreaFromWreckage(_crate)

                        local _spawnedGroup = ctld_c.spawnCrateGroup(_heli, _posArray, _typeArray)

                        ctld_c.completedTemplate[_spawnedGroup:getName()] = ctld_c.getCustomTemplateDetails(_spawnedGroup, templateData)
                        ctld_c.processCallback({unit = _heli, crate = _crate , spawnedGroup = _spawnedGroup, action = "unpack"})
                
                        trigger.action.outTextForCoalition(_heli:getCoalition(), ctld_c.getPlayerNameOrType(_heli) .. " successfully repaired "..templateData.name, ctld_c.displayMessageTime)

                        _crate.crateUnit:destroy()

                        env.info("ctld_c repairByCrate: process complete, repaired: " .. tostring(templateData.name)) 
                    else
                        env.info("ctld_c repairByCrate: errors in spawning a new group")
                    end
                else
                    env.info("ctld_c repairByCrate: no repair needed")
                    trigger.action.outTextForCoalition(_heli:getCoalition(), ctld_c.getPlayerNameOrType(_heli) .. " no repair needed for "..templateData.name, ctld_c.displayMessageTime/2)

                end
            end
        end

        if nogroup == true then
            env.info("ctld_c repairByCrate: template search returning message, printing no template found")
            ctld_c.displayMessageToGroup(_heli, "No damaged template found. Repair crate won't be removed: you can move it somewhere else.", ctld_c.displayMessageTime/2)
        end

    else
        env.info("ctld_c repairByCrate: crate variable is missing")
    end
end

function ctld_c.unpackMultiCrate(_heli, _nearestCrate, _nearbyCrates)

    -- unpack multi crate
    local _nearbyMultiCrates = {}

    for _, _nearbyCrate in pairs(_nearbyCrates) do

        if _nearbyCrate.dist < 300 then

            if _nearbyCrate.details.unit == _nearestCrate.details.unit then

                table.insert(_nearbyMultiCrates, _nearbyCrate)

                if #_nearbyMultiCrates == _nearestCrate.details.cratesRequired then
                    break
                end
            end
        end
    end

    --- check crate count
    if #_nearbyMultiCrates == _nearestCrate.details.cratesRequired then

        local _point = _nearestCrate.crateUnit:getPoint()

        -- destroy crates
        for _, _crate in pairs(_nearbyMultiCrates) do

            if _point == nil then
                _point = _crate.crateUnit:getPoint()
            end

            if _heli:getCoalition() == 1 then
                ctld_c.spawnedCratesRED[_crate.crateUnit:getName()] = nil
            elseif _heli:getCoalition() == 2 then
                ctld_c.spawnedCratesBLUE[_crate.crateUnit:getName()] = nil
            else
                ctld_c.spawnedCratesNEUTRAL[_crate.crateUnit:getName()] = nil
            end

            _crate.crateUnit:destroy()

        end

        local _pointsArray = {}
        local _typeArray = {}
        local _multyUnit = false
        if  _nearestCrate.details.quantity then
            
            for _i = 1, _nearestCrate.details.quantity do
                -- spawn in a circle around the crate
                local _angle = math.pi * 2 * (_i - 1) / _nearestCrate.details.quantity
                local _xOffset = math.cos(_angle) * 12
                local _yOffset = math.sin(_angle) * 12

                local _ipoint = _point

                _ipoint = { x = _ipoint.x + _xOffset, y = _ipoint.y, z = _ipoint.z + _yOffset }

                table.insert(_pointsArray, _ipoint)
                table.insert(_typeArray, _nearestCrate.details.unit)       
            end

            if table.getn(_pointsArray) > 1 then
                if table.getn(_pointsArray) == table.getn(_typeArray) then
                    _multyUnit = true
                end
            end

        end

        local _spawnedGroup = nil
        if _multyUnit == true then
            _spawnedGroup = ctld_c.spawnCrateGroup(_heli, _pointsArray, _typeArray)
        else
           _spawnedGroup = ctld_c.spawnCrateGroup(_heli, { _point }, { _nearestCrate.details.unit })
        end

        ctld_c.processCallback({unit = _heli, crate =  _nearestCrate , spawnedGroup = _spawnedGroup, action = "unpack"})

        local _txt = string.format("%s successfully deployed %s to the field using %d crates", ctld_c.getPlayerNameOrType(_heli), _nearestCrate.details.desc, #_nearbyMultiCrates)

        trigger.action.outTextForCoalition(_heli:getCoalition(), _txt, ctld_c.displayMessageTime/2)

    else

        local _txt = string.format("Cannot build %s!\n\nIt requires %d crates and there are %d \n\nOr the crates are not within 300m of each other", _nearestCrate.details.desc, _nearestCrate.details.cratesRequired, #_nearbyMultiCrates)

        ctld_c.displayMessageToGroup(_heli, _txt, ctld_c.displayMessageTime)
    end
end

function ctld_c.spawnCrateGroup(_heli, _positions, _types)

    local _id = ctld_c.getNextGroupId()

    local _groupName = _types[1] .. "  #" .. _id

    local _side = _heli:getCoalition()

    local _group = {
        ["visible"] = false,
       -- ["groupId"] = _id,
        ["hidden"] = false,
        ["units"] = {},
        --        ["y"] = _positions[1].z,
        --        ["x"] = _positions[1].x,
        ["name"] = _groupName,
        ["task"] = {},
    }

    if #_positions == 1 then

        local _unitId = ctld_c.getNextUnitId()
        local _details = { type = _types[1], unitId = _unitId, name = string.format("Unpacked %s #%i", _types[1], _unitId) }

        _group.units[1] = ctld_c.createUnit(_positions[1].x + 5, _positions[1].z + 5, 120, _details)

    else

        for _i, _pos in ipairs(_positions) do

            local _unitId = ctld_c.getNextUnitId()
            local _details = { type = _types[_i], unitId = _unitId, name = string.format("Unpacked %s #%i", _types[_i], _unitId) }

            _group.units[_i] = ctld_c.createUnit(_pos.x + 5, _pos.z + 5, 120, _details)
        end
    end

    _group.category = Group.Category.GROUND
    _group.country = _heli:getCountry()

    local _spawnedGroup = Group.getByName(ctld_c.dynAdd(_group).name)

    --local _spawnedGroup = coalition.addGroup(_heli:getCountry(), Group.Category.GROUND, _group)

    --activate by moving and so we can set ROE and Alarm state

    local _dest = _spawnedGroup:getUnit(1):getPoint()
    _dest = { x = _dest.x + 0.5, _y = _dest.y + 0.5, z = _dest.z + 0.5 }

    ctld_c.orderGroupToMoveToPoint(_spawnedGroup:getUnit(1), _dest)

    return _spawnedGroup
end



-- spawn normal group
function ctld_c.spawnDroppedGroup(_point, _details, _spawnBehind, _maxSearch)

    local _groupName = _details.groupName

    local _group = {
        ["visible"] = false,
      --  ["groupId"] = _details.groupId,
        ["hidden"] = false,
        ["units"] = {},
        --        ["y"] = _positions[1].z,
        --        ["x"] = _positions[1].x,
        ["name"] = _groupName,
        ["task"] = {},
    }


    if _spawnBehind == false then

        -- spawn in circle around heli

        local _pos = _point

        for _i, _detail in ipairs(_details.units) do

            local _angle = math.pi * 2 * (_i - 1) / #_details.units
            local _xOffset = math.cos(_angle) * 30
            local _yOffset = math.sin(_angle) * 30

            _group.units[_i] = ctld_c.createUnit(_pos.x + _xOffset, _pos.z + _yOffset, _angle, _detail)
        end

    else

        local _pos = _point

        --try to spawn at 6 oclock to us
        local _angle = math.atan2(_pos.z, _pos.x)
        local _xOffset = math.cos(_angle) * -30
        local _yOffset = math.sin(_angle) * -30


        for _i, _detail in ipairs(_details.units) do
            _group.units[_i] = ctld_c.createUnit(_pos.x + (_xOffset + 10 * _i), _pos.z + (_yOffset + 10 * _i), _angle, _detail)
        end
    end

    _group.category = Group.Category.GROUND;
    _group.country = _details.country;

    local _spawnedGroup = Group.getByName(ctld_c.dynAdd(_group).name)

    --local _spawnedGroup = coalition.addGroup(_details.country, Group.Category.GROUND, _group)


    -- find nearest enemy and head there
    if _maxSearch == nil then
        _maxSearch = ctld_c.maximumSearchDistance
    end

    local _wpZone = ctld_c.inWaypointZone(_point,_spawnedGroup:getCoalition())

    if _wpZone.inZone then
        ctld_c.orderGroupToMoveToPoint(_spawnedGroup:getUnit(1), _wpZone.point)
        --env.info("Heading to waypoint - In Zone ".._wpZone.name)
    else
        local _enemyPos = ctld_c.findNearestEnemy(_details.side, _point, _maxSearch)

        ctld_c.orderGroupToMoveToPoint(_spawnedGroup:getUnit(1), _enemyPos)
    end

    return _spawnedGroup
end

function ctld_c.findNearestEnemy(_side, _point, _searchDistance)

    local _closestEnemy = nil

    local _groups

    local _closestEnemyDist = _searchDistance

    local _heliPoint = _point

    if _side == 2 then
        _groups = coalition.getGroups(1, Group.Category.GROUND)
    else
        _groups = coalition.getGroups(2, Group.Category.GROUND)
    end

    for _, _group in pairs(_groups) do

        if _group ~= nil then
            local _units = _group:getUnits()

            if _units ~= nil and #_units > 0 then

                local _leader = nil

                -- find alive leader
                for x = 1, #_units do
                    if _units[x]:getLife() > 0 then
                        _leader = _units[x]
                        break
                    end
                end

                if _leader ~= nil then
                    local _leaderPos = _leader:getPoint()
                    local _dist = ctld_c.getDistance(_heliPoint, _leaderPos)
                    if _dist < _closestEnemyDist then
                        _closestEnemyDist = _dist
                        _closestEnemy = _leaderPos
                    end
                end
            end
        end
    end


    -- no enemy - move to random point
    if _closestEnemy ~= nil then

        -- env.info("found enemy")
        return _closestEnemy
    else

        local _x = _heliPoint.x + math.random(0, ctld_c.maximumMoveDistance) - math.random(0, ctld_c.maximumMoveDistance)
        local _z = _heliPoint.z + math.random(0, ctld_c.maximumMoveDistance) - math.random(0, ctld_c.maximumMoveDistance)
        local _y = _heliPoint.y + math.random(0, ctld_c.maximumMoveDistance) - math.random(0, ctld_c.maximumMoveDistance)

        return { x = _x, z = _z,y=_y }
    end
end

function ctld_c.findNearestGroup(_heli, _groups)

    local _closestGroupDetails = {}
    local _closestGroup = nil

    local _closestGroupDist = ctld_c.maxExtractDistance

    local _heliPoint = _heli:getPoint()

    for _, _groupName in pairs(_groups) do

        local _group = Group.getByName(_groupName)

        if _group ~= nil then
            local _units = _group:getUnits()

            if _units ~= nil and #_units > 0 then

                local _leader = nil

                local _groupDetails = { groupId = _group:getID(), groupName = _group:getName(), side = _group:getCoalition(), units = {} }

                -- find alive leader
                for x = 1, #_units do
                    if _units[x]:getLife() > 0 then

                        if _leader == nil then
                            _leader = _units[x]
                            -- set country based on leader
                            _groupDetails.country = _leader:getCountry()
                        end

                        local _unitDetails = { type = _units[x]:getTypeName(), unitId = _units[x]:getID(), name = _units[x]:getName() }

                        table.insert(_groupDetails.units, _unitDetails)
                    end
                end

                if _leader ~= nil then
                    local _leaderPos = _leader:getPoint()
                    local _dist = ctld_c.getDistance(_heliPoint, _leaderPos)
                    if _dist < _closestGroupDist then
                        _closestGroupDist = _dist
                        _closestGroupDetails = _groupDetails
                        _closestGroup = _group
                    end
                end
            end
        end
    end


    if _closestGroup ~= nil then

        return { group = _closestGroup, details = _closestGroupDetails }
    else

        return nil
    end
end


