-- are we in pickup zone
function ctld_c.inPickupZone(_heli)

    if ctld_c.inAir(_heli) then
        return { inZone = false, limit = -1, index = -1 }
    end

    local _heliPoint = _heli:getPoint()

    for _i, _zoneDetails in pairs(ctld_c.pickupZones) do

        local _triggerZone = trigger.misc.getZone(_zoneDetails[1])

        if _triggerZone == nil then
            local _ship = ctld_c.getTransportUnit(_zoneDetails[1], true)

            if _ship then
                local _point = _ship:getPoint()
                _triggerZone = {}
                _triggerZone.point = _point
                _triggerZone.radius = 200 -- should be big enough for ship
            end

        end

        if _triggerZone ~= nil then

            --get distance to center

            local _dist = ctld_c.getDistance(_heliPoint, _triggerZone.point)

            if _dist <= _triggerZone.radius then
                local _heliCoalition = _heli:getCoalition()
                if _zoneDetails[4] == 1 and (_zoneDetails[5] == _heliCoalition or _zoneDetails[5] == 0) then
                    return { inZone = true, limit = _zoneDetails[3], index = _i }
                end
            end
        end
    end

    local _fobs = ctld_c.getSpawnedFobs(_heli)

    -- now check spawned fobs
    for _, _fob in ipairs(_fobs) do

        --get distance to center

        local _dist = ctld_c.getDistance(_heliPoint, _fob:getPoint())

        if _dist <= 150 then
            return { inZone = true, limit = 10000, index = -1 };
        end
    end



    return { inZone = false, limit = -1, index = -1 };
end

function ctld_c.getSpawnedFobs(_heli)

    local _fobs = {}

    for _, _fobName in ipairs(ctld_c.builtFOBS) do

        local _fob = StaticObject.getByName(_fobName)

        if _fob ~= nil and _fob:isExist() and _fob:getCoalition() == _heli:getCoalition() and _fob:getLife() > 0 then

            table.insert(_fobs, _fob)
        end
    end

    return _fobs
end

-- are we in a dropoff zone
function ctld_c.inDropoffZone(_heli)

    if ctld_c.inAir(_heli) then
        return false
    end

    local _heliPoint = _heli:getPoint()

    for _, _zoneDetails in pairs(ctld_c.dropOffZones) do

        local _triggerZone = trigger.misc.getZone(_zoneDetails[1])

        if _triggerZone ~= nil and (_zoneDetails[3] == _heli:getCoalition() or _zoneDetails[3]== 0) then

            --get distance to center

            local _dist = ctld_c.getDistance(_heliPoint, _triggerZone.point)

            if _dist <= _triggerZone.radius then
                return true
            end
        end
    end

    return false
end

-- are we in a waypoint zone
function ctld_c.inWaypointZone(_point,_coalition)

    for _, _zoneDetails in pairs(ctld_c.wpZones) do

        local _triggerZone = trigger.misc.getZone(_zoneDetails[1])

        --right coalition and active?
        if _triggerZone ~= nil and (_zoneDetails[4] == _coalition or _zoneDetails[4]== 0) and _zoneDetails[3] == 1 then

            --get distance to center

            local _dist = ctld_c.getDistance(_point, _triggerZone.point)

            if _dist <= _triggerZone.radius then
                return {inZone = true, point = _triggerZone.point, name = _zoneDetails[1]}
            end
        end
    end

    return {inZone = false}
end

-- are we near friendly logistics zone
function ctld_c.inFactoryZone(_heli)

    if ctld_c.inAir(_heli) then
        return false
    end

    local _heliPoint = _heli:getPoint()

    local _nearestPos = nil
    local _nearestDeg = nil
    local _nearestDist = 100000000
    for _name, _data in pairs(ctld_c.factoryObjects) do
		
		local _logistic = StaticObject.getByName(_name) 

		if _logistic then
			local coaTest = _logistic:getCoalition()
			

			if _logistic ~= nil and _logistic:getCoalition() == _heli:getCoalition() then
                --get distance
                local _logPoint = _logistic:getPoint()
				local _dist = ctld_c.getDistance(_heliPoint, _logPoint)
                local _deg = math.floor(math.deg(math.atan2(_logPoint.z-_heliPoint.z, _logPoint.x-_heliPoint.x))%360)
				if _dist <= ctld_c.maximumDistanceLogistic then
					return true
                elseif _dist < _nearestDist then
                    _nearestDist = _dist
                    _nearestDeg = _deg
                    _nearestPos = _logPoint
                end
                
			end
		end
    end

    if _nearestPos and _nearestDist and _nearestDeg then
        local km = math.floor(_nearestDist/100)/10
        local _lat, _lon = coord.LOtoLL(_nearestPos)
        local _latLngStr = ctld_c.tostringLL(_lat, _lon, 3, false)
        local _message = _latLngStr .. ", bearing " .. _nearestDeg .. "¬∞, " .. km .. " km"
        
        return false, _message

    else
        return false
    end

end

