function ctld_c.refreshSmoke()

    if ctld_c.disableAllSmoke == true then
        return
    end

    for _, _zoneGroup in pairs({ ctld_c.pickupZones, ctld_c.dropOffZones }) do

        for _, _zoneDetails in pairs(_zoneGroup) do

            local _triggerZone = trigger.misc.getZone(_zoneDetails[1])

            if _triggerZone == nil then
                local _ship = ctld_c.getTransportUnit(_triggerZone)

                if _ship then
                    local _point = _ship:getPoint()
                    _triggerZone = {}
                    _triggerZone.point = _point
                end

            end


            --only trigger if smoke is on AND zone is active

            if _triggerZone ~= nil and type(_zoneDetails) == "table" then
                if type(_zoneDetails[2]) == "number" and type(_zoneDetails[4]) == "number" then
                    if _zoneDetails[2] >= 0 and _zoneDetails[4] == 1 then

                        -- Trigger smoke markers

                        local _pos2 = { x = _triggerZone.point.x, y = _triggerZone.point.z }
                        local _alt = land.getHeight(_pos2)
                        local _pos3 = { x = _pos2.x, y = _alt, z = _pos2.y }

                        trigger.action.smoke(_pos3, _zoneDetails[2])
                    end
                end
            end
        end
    end

    --waypoint zones
    for _, _zoneDetails in pairs(ctld_c.wpZones) do

        local _triggerZone = trigger.misc.getZone(_zoneDetails[1])

        --only trigger if smoke is on AND zone is active
        if _triggerZone ~= nil and _zoneDetails[2] >= 0 and _zoneDetails[3] == 1 then

            -- Trigger smoke markers

            local _pos2 = { x = _triggerZone.point.x, y = _triggerZone.point.z }
            local _alt = land.getHeight(_pos2)
            local _pos3 = { x = _pos2.x, y = _alt, z = _pos2.y }

            trigger.action.smoke(_pos3, _zoneDetails[2])
        end
    end


    --refresh in 5 minutes
    timer.scheduleFunction(ctld_c.refreshSmoke, nil, timer.getTime() + 300)
end

function ctld_c.dropSmoke(_args)

    local _heli = ctld_c.getTransportUnit(_args[1])

    if _heli ~= nil then

        local _colour = ""

        if _args[2] == trigger.smokeColor.Red then

            _colour = "RED"
        elseif _args[2] == trigger.smokeColor.Blue then

            _colour = "BLUE"
        elseif _args[2] == trigger.smokeColor.Green then

            _colour = "GREEN"
        elseif _args[2] == trigger.smokeColor.Orange then

            _colour = "ORANGE"
        end

        local _point = _heli:getPoint()

        local _pos2 = { x = _point.x, y = _point.z }
        local _alt = land.getHeight(_pos2)
        local _pos3 = { x = _point.x, y = _alt, z = _point.z }

        trigger.action.smoke(_pos3, _args[2])

        trigger.action.outTextForCoalition(_heli:getCoalition(), ctld_c.getPlayerNameOrType(_heli) .. " dropped " .. _colour .. " smoke ", ctld_c.displayMessageTime/2)
    end
end

function ctld_c.unitCanCarryVehicles(_unit)

    local _type = string.lower(_unit:getTypeName())

    for _, _name in ipairs(ctld_c.vehicleTransportEnabled) do
        local _nameLower = string.lower(_name)
        if string.match(_type, _nameLower) then
            return true
        end
    end

    return false
end

function ctld_c.isJTACUnitType(_type)
    if _type then
        _type = string.lower(_type)

        for _, _name in ipairs(ctld_c.jtacUnitTypes) do
            local _nameLower = string.lower(_name)
            if string.match(_type, _nameLower) then
                return true
            end
        end
    end

    return false
end

function ctld_c.updateZoneCounter(_index, _diff)

    if ctld_c.pickupZones[_index] ~= nil then

        ctld_c.pickupZones[_index][3] = ctld_c.pickupZones[_index][3] + _diff

        if ctld_c.pickupZones[_index][3] < 0 then
            ctld_c.pickupZones[_index][3] = 0
        end

        if ctld_c.pickupZones[_index][6] ~= nil then
            trigger.action.setUserFlag(ctld_c.pickupZones[_index][6], ctld_c.pickupZones[_index][3])
        end
        --  env.info(ctld_c.pickupZones[_index][1].." = " ..ctld_c.pickupZones[_index][3])
    end
end

function ctld_c.processCallback(_callbackArgs)

    for _, _callback in pairs(ctld_c.callbacks) do

        local _status, _result = pcall(function()

            _callback(_callbackArgs)

        end)

        if (not _status) then
            env.error(string.format("ctld_c Callback Error: %s", _result))
        end
    end
end


-- checks the status of all AI troop carriers and auto loads and unloads troops
-- as long as the troops are on the ground
function ctld_c.checkAIStatus()

    timer.scheduleFunction(ctld_c.checkAIStatus, nil, timer.getTime() + 2)


    for _, _unitName in pairs(ctld_c.transportPilotNames) do
        local status, error = pcall(function()

            local _unit = ctld_c.getTransportUnit(_unitName)

            -- no player name means AI!
            if _unit ~= nil and _unit:getPlayerName() == nil then
                local _zone = ctld_c.inPickupZone(_unit)
                --  env.error("Checking.. ".._unit:getName())
                if _zone.inZone == true and not ctld_c.troopsOnboard(_unit, true) then
                    --   env.error("in zone, loading.. ".._unit:getName())

                    if ctld_c.allowRandomAiTeamPickups == true then
                        -- Random troop pickup implementation
                        local _team = nil
                        if _unit:getCoalition() == 1 then
                            _team = math.floor((math.random(#ctld_c.redTeams * 100) / 100) + 1)
                            ctld_c.loadTroopsFromZone({ _unitName, true,ctld_c.loadableGroups[ctld_c.redTeams[_team]],true })
                        else
                            _team = math.floor((math.random(#ctld_c.blueTeams * 100) / 100) + 1)
                            ctld_c.loadTroopsFromZone({ _unitName, true,ctld_c.loadableGroups[ctld_c.blueTeams[_team]],true })
                        end
                    else
                        env.info("DSMC checkAIStatus loading troop from zone. unit: " .. tostring(_unitName))
                        ctld_c.loadTroopsFromZone({ _unitName, true,"",true })
                    end

                elseif ctld_c.inDropoffZone(_unit) and ctld_c.troopsOnboard(_unit, true) then
                    --     env.error("in dropoff zone, unloading.. ".._unit:getName())
                    env.info("DSMC checkAIStatus dropping troop from zone. unit: " .. tostring(_unitName))
                    ctld_c.unloadMultiTroops( { _unitName, true })
                end

                if ctld_c.unitCanCarryVehicles(_unit) then

                    if _zone.inZone == true and not ctld_c.troopsOnboard(_unit, false) then
                        env.info("DSMC checkAIStatus loading vehicle from zone. unit: " .. tostring(_unitName))
                        ctld_c.loadTroopsFromZone({ _unitName, false,"",true })

                    elseif ctld_c.inDropoffZone(_unit) and ctld_c.troopsOnboard(_unit, false) then
                        env.info("DSMC checkAIStatus dropping vehicle from zone. unit: " .. tostring(_unitName))
                        ctld_c.unloadTroops( { _unitName, false })
                    end
                end
            end
        end)

        if (not status) then
            env.error(string.format("Error with ai status: %s", error), false)
        end
    end
end

function ctld_c.getTransportLimit(_unitType)

    if ctld_c.unitLoadLimits[_unitType] then

        return ctld_c.unitLoadLimits[_unitType]
    end

    return ctld_c.numberOfTroops

end

function ctld_c.getUnitActions(_unitType)

    if ctld_c.unitActions[_unitType] then
        return ctld_c.unitActions[_unitType]
    end

    return {crates=true,troops=true}

end

