function ctld_c.addRadioListCommand(_side)

    local _players = coalition.getPlayers(_side)

    if _players ~= nil then

        for _, _playerUnit in pairs(_players) do

            local _groupId = ctld_c.getGroupId(_playerUnit)

            if _groupId then

                if ctld_c.addedTo[tostring(_groupId)] == nil then
                    missionCommands.addCommandForGroup(_groupId, "List Radio Beacons", nil, ctld_c.listRadioBeacons, { _playerUnit:getName() })
                    ctld_c.addedTo[tostring(_groupId)] = true
                end
            end
        end
    end
end

function ctld_c.addJTACRadioCommand(_side)

    local _players = coalition.getPlayers(_side)

    if _players ~= nil then

        for _, _playerUnit in pairs(_players) do

            local _groupId = ctld_c.getGroupId(_playerUnit)

            if _groupId then
                --   env.info("adding command for "..index)
                if ctld_c.jtacRadioAdded[tostring(_groupId)] == nil then
                    -- env.info("about command for "..index)
                    missionCommands.addCommandForGroup(_groupId, "JTAC Status", nil, ctld_c.getJTACStatus, { _playerUnit:getName() })
                    ctld_c.jtacRadioAdded[tostring(_groupId)] = true
                    -- env.info("Added command for " .. index)
                end
            end


        end
    end
end

