	if _unit then
		
		local _group = _unit:getGroup()
		local _groupId = _group:getID()
		return _groupId
	
	end
	
	return nil
    
end

--get distance in meters assuming a Flat world
function ctld_c.getDistance(_point1, _point2)

    local xUnit = _point1.x
    local yUnit = _point1.z
    local xZone = _point2.x
    local yZone = _point2.z

    local xDiff = xUnit - xZone
    local yDiff = yUnit - yZone

    return math.sqrt(xDiff * xDiff + yDiff * yDiff)
end


------------ JTAC -----------
ctld_c.jtacLaserPoints = {}
ctld_c.jtacIRPoints = {}
ctld_c.jtacSmokeMarks = {}
ctld_c.jtacUnits = {} -- list of JTAC units for f10 command
ctld_c.jtacStop = {} -- jtacs to tell to stop lasing
ctld_c.jtacCurrentTargets = {}
ctld_c.jtacRadioAdded = {} --keeps track of who's had the radio command added
ctld_c.jtacGeneratedLaserCodes = {} -- keeps track of generated codes, cycles when they run out
ctld_c.jtacLaserPointCodes = {}
ctld_c.jtacColor = {}

function ctld_c.CreateJTAC(group, code)
	local _side = ctld_c.getGroup(group)[1]:getCoalition()
	
	ctld_c.jtacLaserPointCodes[group] = code
	
	if _side == 1 then
		ctld_c.jtacColor[group] = ctld_c.JTAC_smokeColour_RED
	else
		ctld_c.jtacColor[group] = ctld_c.JTAC_smokeColour_BLUE
	end
	
	ctld_c.JTACAutoLase(group, code)
						
	if ctld_c.deployedJTACs[_side] == nil then
		ctld_c.deployedJTACs[_side] = {}
	end
	table.insert(ctld_c.deployedJTACs[_side], group)
	
	ctld_c.refreshJTACMenu(_side)	
end

function ctld_c.changeLaserCode(_args)
	local _SelectedLazingCode = tonumber(_args[2])
	if tonumber(ctld_c.jtacLaserPointCodes[_args[1]]) ~= _SelectedLazingCode then
		--TODO: check unit's life
		ctld_c.JTACAutoLaseStop(_args[1])
		local _smoke
		if _args[3] == 1 then
			_smoke = ctld_c.JTAC_smokeOn_RED
		else
			_smoke = ctld_c.JTAC_smokeOn_BLUE
		end
		
		timer.scheduleFunction(ctld_c.timerJTACAutoLase, { _args[1], _SelectedLazingCode, _smoke, ctld_c.JTAC_lock, ctld_c.jtacColor[_args[1]]}, timer.getTime() + 5) --TODO: check interval
		
		ctld_c.notifyCoalition(_args[1]..": Changing laser code to ".. _SelectedLazingCode, 10, _args[3])
		
		ctld_c.jtacLaserPointCodes[_args[1]] = _SelectedLazingCode
	else
		ctld_c.notifyCoalition(_args[1]..": I'm already lazing with code ".. _SelectedLazingCode, 10, _args[3])
	end
end

function ctld_c.changeJTACColor(_args)
	if ctld_c.GetColorName(ctld_c.jtacColor[_args[1]]) ~= _args[2] then
		ctld_c.JTACAutoLaseStop(_args[1])
		
		local _smoke
		if _args[3] == 1 then
			_smoke = ctld_c.JTAC_smokeOn_RED
		else
			_smoke = ctld_c.JTAC_smokeOn_BLUE
		end
		
		local _Color = -1  -- no smoke?
		if _args[2] == "Green" then
			_Color = 0
		elseif _args[2] == "Red" then
			_Color = 1
		elseif _args[2] == "White" then
			_Color = 2
		elseif _args[2] == "Orange" then
			_Color = 3
		elseif _args[2] == "Blue" then
			_Color = 4
		end
		
		timer.scheduleFunction(ctld_c.timerJTACAutoLase, { _args[1], ctld_c.jtacLaserPointCodes[_args[1]], _smoke, ctld_c.JTAC_lock, _Color }, timer.getTime() + 5) --TODO: check interval
			
		ctld_c.notifyCoalition(_args[1]..": Changing color to ".._args[2], 10, _args[3])
		
		ctld_c.jtacColor[_args[1]] = _Color
	else
		ctld_c.notifyCoalition(_args[1]..": Smoke color is already ".._args[2]..".", 10, _args[3])
	end
end

function ctld_c.refreshJTACMenu(_side)
	if ctld_c.JTACCommandMenuPath[tostring(_side)] ~= nil then
	  missionCommands.removeItemForCoalition(_side, ctld_c.JTACCommandMenuPath[tostring(_side)])
	end
	local _JTACMenu
	if next(ctld_c.deployedJTACs[_side]) ~= nil then
		_JTACMenu = missionCommands.addSubMenuForCoalition(_side, "JTAC Command", nil)
	else 
		return
	end
	
	ctld_c.JTACCommandMenuPath[tostring(_side)] = _JTACMenu
	local itemNo = 0
	--Add one menu item foreach deployed JTAC unit?
	local _JTACMenuItem = {}
	local _JTACMenuItemLaser = {}
	local _JTACMenuItemColor = {}
	for _, _JTACGroup in pairs(ctld_c.deployedJTACs[_side]) do
		--local _CurrentLazingCode = ctld_c.jtacLaserPointCodes[_JTACGroup]
		--local _CurrentSmokeColor = ctld_c.GetColorName(ctld_c.jtacColor[_JTACGroup])
		
		_JTACMenuItem[itemNo] = missionCommands.addSubMenuForCoalition(_side, _JTACGroup, _JTACMenu)
			
		--Add laser code submenus
		_JTACMenuItemLaser[itemNo] = missionCommands.addSubMenuForCoalition(_side, "Change laser code", _JTACMenuItem[itemNo])
		for _, _laseCode in pairs(ctld_c.laser_codes) do
			missionCommands.addCommandForCoalition(_side, "to ".._laseCode, _JTACMenuItemLaser[itemNo], ctld_c.changeLaserCode, { _JTACGroup, _laseCode, _side})
		end
		
		--Add color change submenus
		_JTACMenuItemColor[itemNo] = missionCommands.addSubMenuForCoalition(_side, "Change smoke color", _JTACMenuItem[itemNo])
		for _, _smokeColor in pairs(ctld_c.JTAC_smokeColous) do
			missionCommands.addCommandForCoalition(_side, "to ".._smokeColor, _JTACMenuItemColor[itemNo], ctld_c.changeJTACColor, { _JTACGroup, _smokeColor, _side})
		end
		itemNo = itemNo + 1
	end
end


function ctld_c.JTACAutoLase(_jtacGroupName, _laserCode, _smoke, _lock, _colour)

    if ctld_c.jtacStop[_jtacGroupName] == true then
        ctld_c.jtacStop[_jtacGroupName] = nil -- allow it to be started again
        ctld_c.cleanupJTAC(_jtacGroupName)
        return
    end

    if _lock == nil then

        _lock = ctld_c.JTAC_lock
    end


    ctld_c.jtacLaserPointCodes[_jtacGroupName] = _laserCode

    local _jtacGroup = ctld_c.getGroup(_jtacGroupName)
    local _jtacUnit

    if _jtacGroup == nil or #_jtacGroup == 0 then

        --check not in a heli
        for _, _onboard in pairs(ctld_c.inTransitTroops) do
            if _onboard ~= nil then
                if _onboard.troops ~= nil and _onboard.troops.groupName ~= nil and _onboard.troops.groupName == _jtacGroupName then

                    --jtac soldier being transported by heli
                    ctld_c.cleanupJTAC(_jtacGroupName)

                    --env.info(_jtacGroupName .. ' in Transport - Waiting 10 seconds')
                    timer.scheduleFunction(ctld_c.timerJTACAutoLase, { _jtacGroupName, _laserCode, _smoke, _lock, _colour }, timer.getTime() + 10)
                    return
                end

                if _onboard.vehicles ~= nil and _onboard.vehicles.groupName ~= nil and _onboard.vehicles.groupName == _jtacGroupName then
                    --jtac vehicle being transported by heli
                    ctld_c.cleanupJTAC(_jtacGroupName)

                    --env.info(_jtacGroupName .. ' in Transport - Waiting 10 seconds')
                    timer.scheduleFunction(ctld_c.timerJTACAutoLase, { _jtacGroupName, _laserCode, _smoke, _lock, _colour }, timer.getTime() + 10)
                    return
                end
            end
        end


        if ctld_c.jtacUnits[_jtacGroupName] ~= nil then
			local _side = ctld_c.jtacUnits[_jtacGroupName].side
            ctld_c.notifyCoalition("JTAC Group " .. _jtacGroupName .. " KIA!", ctld_c.displayMessageTime/2, _side)
			
			ctld_c.deployedJTACs[_side] = {}
			for _jtacGroupName, _jtacDetails in pairs(ctld_c.jtacUnits) do
				_jtacUnit = Unit.getByName(_jtacDetails.name)
				if _jtacUnit ~= nil and _jtacUnit:getLife() > 0 and _jtacUnit:getCoalition() == _side then
					table.insert(ctld_c.deployedJTACs[_side], _jtacGroupName)
				end
			end
			ctld_c.refreshJTACMenu(ctld_c.jtacUnits[_jtacGroupName].side)
		end
		
        --remove from list
        ctld_c.jtacUnits[_jtacGroupName] = nil

        ctld_c.cleanupJTAC(_jtacGroupName)

        return
    else

        _jtacUnit = _jtacGroup[1]
        --add to list
        ctld_c.jtacUnits[_jtacGroupName] = { name = _jtacUnit:getName(), side = _jtacUnit:getCoalition() }

        -- work out smoke colour
        if _colour == nil then

            if _jtacUnit:getCoalition() == 1 then
                _colour = ctld_c.JTAC_smokeColour_RED
            else
                _colour = ctld_c.JTAC_smokeColour_BLUE
            end
        end


        if _smoke == nil then

            if _jtacUnit:getCoalition() == 1 then
                _smoke = ctld_c.JTAC_smokeOn_RED
            else
                _smoke = ctld_c.JTAC_smokeOn_BLUE
            end
        end
    end


    -- search for current unit

    if _jtacUnit:isActive() == false then

        ctld_c.cleanupJTAC(_jtacGroupName)

        --env.info(_jtacGroupName .. ' Not Active - Waiting 30 seconds')
        timer.scheduleFunction(ctld_c.timerJTACAutoLase, { _jtacGroupName, _laserCode, _smoke, _lock, _colour }, timer.getTime() + 30)

        return
    end

    local _enemyUnit = ctld_c.getCurrentUnit(_jtacUnit, _jtacGroupName)

    if _enemyUnit == nil and ctld_c.jtacCurrentTargets[_jtacGroupName] ~= nil then

        local _tempUnitInfo = ctld_c.jtacCurrentTargets[_jtacGroupName]

        --      env.info("TEMP UNIT INFO: " .. tempUnitInfo.name .. " " .. tempUnitInfo.unitType)

        local _tempUnit = Unit.getByName(_tempUnitInfo.name)

        if _tempUnit ~= nil and _tempUnit:getLife() > 0 and _tempUnit:isActive() == true then
            ctld_c.notifyCoalition(_jtacGroupName .. " target " .. _tempUnitInfo.unitType .. " lost. Scanning for Targets. ", ctld_c.displayMessageTime/2, _jtacUnit:getCoalition())
        else
            ctld_c.notifyCoalition(_jtacGroupName .. " target " .. _tempUnitInfo.unitType .. " KIA. Good Job! Scanning for Targets. ", ctld_c.displayMessageTime/2, _jtacUnit:getCoalition())
        end

        --remove from smoke list
        ctld_c.jtacSmokeMarks[_tempUnitInfo.name] = nil

        -- remove from target list
        ctld_c.jtacCurrentTargets[_jtacGroupName] = nil

        --stop lasing
        ctld_c.cancelLase(_jtacGroupName)
    end


    if _enemyUnit == nil then
        _enemyUnit = ctld_c.findNearestVisibleEnemy(_jtacUnit, _lock)

        if _enemyUnit ~= nil then

            -- store current target for easy lookup
            ctld_c.jtacCurrentTargets[_jtacGroupName] = { name = _enemyUnit:getName(), unitType = _enemyUnit:getTypeName(), unitId = _enemyUnit:getID() }

            ctld_c.notifyCoalition(_jtacGroupName .. " lasing new target " .. _enemyUnit:getTypeName() .. '. CODE: ' .. _laserCode .. ctld_c.getPositionString(_enemyUnit), ctld_c.displayMessageTime, _jtacUnit:getCoalition())

            -- create smoke
            if _smoke == true then

                --create first smoke
                ctld_c.createSmokeMarker(_enemyUnit, _colour)
            end
        end
    end

    if _enemyUnit ~= nil then

        ctld_c.laseUnit(_enemyUnit, _jtacUnit, _jtacGroupName, _laserCode)

        --   env.info('Timer timerSparkleLase '..jtacGroupName.." "..laserCode.." "..enemyUnit:getName())
        timer.scheduleFunction(ctld_c.timerJTACAutoLase, { _jtacGroupName, _laserCode, _smoke, _lock, _colour }, timer.getTime() + 1)


        if _smoke == true then
            local _nextSmokeTime = ctld_c.jtacSmokeMarks[_enemyUnit:getName()]

            --recreate smoke marker after 5 mins
            if _nextSmokeTime ~= nil and _nextSmokeTime < timer.getTime() then

                ctld_c.createSmokeMarker(_enemyUnit, _colour)
            end
        end

    else
        -- env.info('LASE: No Enemies Nearby')

        -- stop lazing the old spot
        ctld_c.cancelLase(_jtacGroupName)
        --  env.info('Timer Slow timerSparkleLase '..jtacGroupName.." "..laserCode.." "..enemyUnit:getName())

        timer.scheduleFunction(ctld_c.timerJTACAutoLase, { _jtacGroupName, _laserCode, _smoke, _lock, _colour }, timer.getTime() + 5)
    end
end

function ctld_c.JTACAutoLaseStop(_jtacGroupName)
    ctld_c.jtacStop[_jtacGroupName] = true
end

-- used by the timer function
function ctld_c.timerJTACAutoLase(_args)

    ctld_c.JTACAutoLase(_args[1], _args[2], _args[3], _args[4], _args[5])
end

function ctld_c.cleanupJTAC(_jtacGroupName)
    -- clear laser - just in case
    ctld_c.cancelLase(_jtacGroupName)

    -- Cleanup
    ctld_c.jtacUnits[_jtacGroupName] = nil

    ctld_c.jtacCurrentTargets[_jtacGroupName] = nil
end


function ctld_c.notifyCoalition(_message, _displayFor, _side)


    trigger.action.outTextForCoalition(_side, _message, _displayFor)
    --trigger.action.outSoundForCoalition(_side, "radiobeep.ogg")
end

function ctld_c.createSmokeMarker(_enemyUnit, _colour)

    --recreate in 5 mins
    ctld_c.jtacSmokeMarks[_enemyUnit:getName()] = timer.getTime() + 300.0

    -- move smoke 2 meters above target for ease
    local _enemyPoint = _enemyUnit:getPoint()
    trigger.action.smoke({ x = _enemyPoint.x, y = _enemyPoint.y + 2.0, z = _enemyPoint.z }, _colour)
end

function ctld_c.cancelLase(_jtacGroupName)

    --local index = "JTAC_"..jtacUnit:getID()

    local _tempLase = ctld_c.jtacLaserPoints[_jtacGroupName]

    if _tempLase ~= nil then
        Spot.destroy(_tempLase)
        ctld_c.jtacLaserPoints[_jtacGroupName] = nil

        --      env.info('Destroy laze  '..index)

        _tempLase = nil
    end

    local _tempIR = ctld_c.jtacIRPoints[_jtacGroupName]

    if _tempIR ~= nil then
        Spot.destroy(_tempIR)
        ctld_c.jtacIRPoints[_jtacGroupName] = nil

        --  env.info('Destroy laze  '..index)

        _tempIR = nil
    end
end

function ctld_c.laseUnit(_enemyUnit, _jtacUnit, _jtacGroupName, _laserCode)

    --cancelLase(jtacGroupName)

    local _spots = {}

    local _enemyVector = _enemyUnit:getPoint()
    local _enemyVectorUpdated = { x = _enemyVector.x, y = _enemyVector.y + 2.0, z = _enemyVector.z }

    local _oldLase = ctld_c.jtacLaserPoints[_jtacGroupName]
    local _oldIR = ctld_c.jtacIRPoints[_jtacGroupName]

    if _oldLase == nil or _oldIR == nil then

        -- create lase

        local _status, _result = pcall(function()
            _spots['irPoint'] = Spot.createInfraRed(_jtacUnit, { x = 0, y = 2.0, z = 0 }, _enemyVectorUpdated)
            _spots['laserPoint'] = Spot.createLaser(_jtacUnit, { x = 0, y = 2.0, z = 0 }, _enemyVectorUpdated, _laserCode)
            return _spots
        end)

        if not _status then
            env.error('ERROR: ' .. _result, false)
        else
            if _result.irPoint then

                --    env.info(jtacUnit:getName() .. ' placed IR Pointer on '..enemyUnit:getName())

                ctld_c.jtacIRPoints[_jtacGroupName] = _result.irPoint --store so we can remove after
            end
            if _result.laserPoint then

                --  env.info(jtacUnit:getName() .. ' is Lasing '..enemyUnit:getName()..'. CODE:'..laserCode)

                ctld_c.jtacLaserPoints[_jtacGroupName] = _result.laserPoint
            end
        end

    else

        -- update lase

        if _oldLase ~= nil then
            _oldLase:setPoint(_enemyVectorUpdated)
        end

        if _oldIR ~= nil then
            _oldIR:setPoint(_enemyVectorUpdated)
        end
    end
end

-- get currently selected unit and check they're still in range
function ctld_c.getCurrentUnit(_jtacUnit, _jtacGroupName)


    local _unit = nil

    if ctld_c.jtacCurrentTargets[_jtacGroupName] ~= nil then
        _unit = Unit.getByName(ctld_c.jtacCurrentTargets[_jtacGroupName].name)
    end

    local _tempPoint = nil
    local _tempDist = nil
    local _tempPosition = nil

    local _jtacPosition = _jtacUnit:getPosition()
    local _jtacPoint = _jtacUnit:getPoint()

    if _unit ~= nil and _unit:getLife() > 0 and _unit:isActive() == true then

        -- calc distance
        _tempPoint = _unit:getPoint()
        --   tempPosition = unit:getPosition()

        _tempDist = ctld_c.getDistance(_unit:getPoint(), _jtacUnit:getPoint())
        if _tempDist < ctld_c.JTAC_maxDistance then
            -- calc visible

            -- check slightly above the target as rounding errors can cause issues, plus the unit has some height anyways
            local _offsetEnemyPos = { x = _tempPoint.x, y = _tempPoint.y + 2.0, z = _tempPoint.z }
            local _offsetJTACPos = { x = _jtacPoint.x, y = _jtacPoint.y + 2.0, z = _jtacPoint.z }

            if land.isVisible(_offsetEnemyPos, _offsetJTACPos) then
                return _unit
            end
        end
    end
    return nil
end


-- Find nearest enemy to JTAC that isn't blocked by terrain
function ctld_c.findNearestVisibleEnemy(_jtacUnit, _targetType,_distance)

    --local startTime = os.clock()

    local _maxDistance = _distance or ctld_c.JTAC_maxDistance

    local _nearestDistance = _maxDistance

    local _jtacPoint = _jtacUnit:getPoint()
    local _coa =    _jtacUnit:getCoalition()

    local _offsetJTACPos = { x = _jtacPoint.x, y = _jtacPoint.y + 2.0, z = _jtacPoint.z }

    local _volume = {
        id = world.VolumeType.SPHERE,
        params = {
            point = _offsetJTACPos,
            radius = _maxDistance
        }
    }

    local _unitList = {}


    local _search = function(_unit, _coa)
        pcall(function()

            if _unit ~= nil
                    and _unit:getLife() > 0
                    and _unit:isActive()
                    and _unit:getCoalition() ~= _coa
                    and not _unit:inAir()
                    and not ctld_c.alreadyTarget(_jtacUnit,_unit) then

                local _tempPoint = _unit:getPoint()
                local _offsetEnemyPos = { x = _tempPoint.x, y = _tempPoint.y + 2.0, z = _tempPoint.z }

                if land.isVisible(_offsetJTACPos,_offsetEnemyPos ) then

                    local _dist = ctld_c.getDistance(_offsetJTACPos, _offsetEnemyPos)

                    if _dist < _maxDistance then
                        table.insert(_unitList,{unit=_unit, dist=_dist})

                    end
                end
            end
        end)

        return true
    end

    world.searchObjects(Object.Category.UNIT, _volume, _search, _coa)

    --log.info(string.format("JTAC Search elapsed time: %.4f\n", os.clock() - startTime))

    -- generate list order by distance & visible

    -- first check
    -- hpriority
    -- priority
    -- vehicle
    -- unit

    local _sort = function( a,b ) return a.dist < b.dist end
    table.sort(_unitList,_sort)
    -- sort list

    -- check for hpriority
    for _, _enemyUnit in ipairs(_unitList) do
        local _enemyName = _enemyUnit.unit:getName()

        if string.match(_enemyName, "hpriority") then
            return _enemyUnit.unit
        end
    end

    for _, _enemyUnit in ipairs(_unitList) do
        local _enemyName = _enemyUnit.unit:getName()

        if string.match(_enemyName, "priority") then
            return _enemyUnit.unit
        end
    end

    for _, _enemyUnit in ipairs(_unitList) do
        local _enemyName = _enemyUnit.unit:getName()

        if (_targetType == "vehicle" and ctld_c.isVehicle(_enemyUnit.unit)) or _targetType == "all" then
            return _enemyUnit.unit

        elseif (_targetType == "troop" and ctld_c.isInfantry(_enemyUnit.unit)) or _targetType == "all" then
            return _enemyUnit.unit
        end
    end

    return nil

end


function ctld_c.listNearbyEnemies(_jtacUnit)

    local _maxDistance =  ctld_c.JTAC_maxDistance

    local _jtacPoint = _jtacUnit:getPoint()
    local _coa =    _jtacUnit:getCoalition()

    local _offsetJTACPos = { x = _jtacPoint.x, y = _jtacPoint.y + 2.0, z = _jtacPoint.z }

    local _volume = {
        id = world.VolumeType.SPHERE,
        params = {
            point = _offsetJTACPos,
            radius = _maxDistance
        }
    }
    local _enemies = nil

    local _search = function(_unit, _coa)
        pcall(function()

            if _unit ~= nil
                    and _unit:getLife() > 0
                    and _unit:isActive()
                    and _unit:getCoalition() ~= _coa
                    and not _unit:inAir() then

                local _tempPoint = _unit:getPoint()
                local _offsetEnemyPos = { x = _tempPoint.x, y = _tempPoint.y + 2.0, z = _tempPoint.z }

                if land.isVisible(_offsetJTACPos,_offsetEnemyPos ) then

                    if not _enemies then
                        _enemies = {}
                    end

                    _enemies[_unit:getTypeName()] = _unit:getTypeName()

                end
            end
        end)

        return true
    end

    world.searchObjects(Object.Category.UNIT, _volume, _search, _coa)

    return _enemies
end

-- tests whether the unit is targeted by another JTAC
function ctld_c.alreadyTarget(_jtacUnit, _enemyUnit)

    for _, _jtacTarget in pairs(ctld_c.jtacCurrentTargets) do

        if _jtacTarget.unitId == _enemyUnit:getID() then
            -- env.info("ALREADY TARGET")
            return true
        end
    end

    return false
end


-- Returns only alive units from group but the group / unit may not be active

function ctld_c.getGroup(groupName)

    local _groupUnits = Group.getByName(groupName)

    local _filteredUnits = {} --contains alive units
    local _x = 1

    if _groupUnits ~= nil and _groupUnits:isExist() then

        _groupUnits = _groupUnits:getUnits()

        if _groupUnits ~= nil and #_groupUnits > 0 then
            for _x = 1, #_groupUnits do
                if _groupUnits[_x]:getLife() > 0  then -- removed and _groupUnits[_x]:isExist() as isExist doesnt work on single units!
                table.insert(_filteredUnits, _groupUnits[_x])
                end
            end
        end
    end

    return _filteredUnits
end

function ctld_c.getAliveGroup(_groupName)

    local _group = Group.getByName(_groupName)

    if _group and _group:isExist() == true and #_group:getUnits() > 0 then
        return _group
    end

    return nil
end

-- gets the JTAC status and displays to coalition units
function ctld_c.getJTACStatus(_args)

    --returns the status of all JTAC units

    local _playerUnit = ctld_c.getTransportUnit(_args[1])

    if _playerUnit == nil then
        return
    end

    local _side = _playerUnit:getCoalition()

    local _jtacGroupName = nil
    local _jtacUnit = nil

    local _message = "JTAC STATUS: \n\n"

    for _jtacGroupName, _jtacDetails in pairs(ctld_c.jtacUnits) do

        --look up units
        _jtacUnit = Unit.getByName(_jtacDetails.name)

        if _jtacUnit ~= nil and _jtacUnit:getLife() > 0 and _jtacUnit:isActive() == true and _jtacUnit:getCoalition() == _side then

            local _enemyUnit = ctld_c.getCurrentUnit(_jtacUnit, _jtacGroupName)

            local _laserCode = ctld_c.jtacLaserPointCodes[_jtacGroupName]

            if _laserCode == nil then
                _laserCode = "UNKNOWN"
            end

            if _enemyUnit ~= nil and _enemyUnit:getLife() > 0 and _enemyUnit:isActive() == true then
                _message = _message .. "" .. _jtacGroupName .. " targeting " .. _enemyUnit:getTypeName() .. " CODE: " .. _laserCode .. ctld_c.getPositionString(_enemyUnit) .. "\n"

                local _list = ctld_c.listNearbyEnemies(_jtacUnit)

                if _list then
                    _message = _message.."Visual On: "

                    for _,_type in pairs(_list) do
                        _message = _message.._type.." "
                    end
                    _message = _message.."\n"
                end

            else
                _message = _message .. "" .. _jtacGroupName .. " searching for targets" .. ctld_c.getPositionString(_jtacUnit) .. "\n"
            end
        end
    end

    if _message == "JTAC STATUS: \n\n" then
        _message = "No Active JTACs"
    end


    ctld_c.notifyCoalition(_message, ctld_c.displayMessageTime, _side)
end

function ctld_c.GetColorName(_Color)
	local _ColorName = "No"
	if _Color == 0 then
		_ColorName = "Green"
	elseif _Color == 1 then
		_ColorName = "Red"
	elseif _Color == 2 then
		_ColorName = "White"
	elseif _Color == 3 then
		_ColorName = "Orange"
	elseif _Color == 4 then
		_ColorName = "Blue"
	end
	return _ColorName
end

function ctld_c.isInfantry(_unit)

    local _typeName = _unit:getTypeName()

    --type coerce tostring
    _typeName = string.lower(_typeName .. "")

    local _soldierType = { "infantry", "paratrooper", "stinger", "manpad", "mortar" }

    for _key, _value in pairs(_soldierType) do
        if string.match(_typeName, _value) then
            return true
        end
    end

    return false
end

-- assume anything that isnt soldier is vehicle
function ctld_c.isVehicle(_unit)

    if ctld_c.isInfantry(_unit) then
        return false
    end

    return true
end

-- The entered value can range from 1111 - 1788,
-- -- but the first digit of the series must be a 1 or 2
-- -- and the last three digits must be between 1 and 8.
--  The range used to be bugged so its not 1 - 8 but 0 - 7.
-- function below will use the range 1-7 just incase
function ctld_c.generateLaserCode()

    ctld_c.jtacGeneratedLaserCodes = {}

    -- generate list of laser codes
    local _code = 1111

    local _count = 1

    while _code < 1777 and _count < 30 do

        while true do

            _code = _code + 1

            if not ctld_c.containsDigit(_code, 8)
                    and not ctld_c.containsDigit(_code, 9)
                    and not ctld_c.containsDigit(_code, 0) then

                table.insert(ctld_c.jtacGeneratedLaserCodes, _code)

                --env.info(_code.." Code")
                break
            end
        end
        _count = _count + 1
    end
end

function ctld_c.jtacGetLaserCodeBySide(_side)
	return ctld_c.laser_codes[_side]
end


function ctld_c.containsDigit(_number, _numberToFind)

    local _thisNumber = _number
    local _thisDigit = 0

    while _thisNumber ~= 0 do

        _thisDigit = _thisNumber % 10
        _thisNumber = math.floor(_thisNumber / 10)

        if _thisDigit == _numberToFind then
            return true
        end
    end

    return false
end

function ctld_c.isAvailableVHFFrequency( candidateFreq )
    local _skipFrequencies = {
        214, 274, 291.5, 297.50,
        300.50, 307, 309.50, 311, 312, 312.50, 320, 324, 326, -- Nevada
        329, 330, 337, 342, 348, 352, 353.00, 380, 381, 384, 389, 395, 396,
        420, 430, 435, 440, 455, 462, 470, 485,
        507, 515, 520, 525, 528, 577, 580,
        602, 625, 641, 662, 670, 680, 682, 690,
        705, 720, 722, 730, 735, 740, 745, --Astrahan
        750, 770, 795,
        822, 830, 862,  866, 
        905, 907, 920, 935, 942, 950, 995,
        1000, 1025, 1030, 1050, 1065,
        1116, 1175, 1182,
        1210
    }
    for _, value in pairs( _skipFrequencies ) do
        if value * 1000 == candidateFreq then
            return false
        end
    end

    return true
end

-- 200 - 400 in 10KHz
-- 400 - 850 in 10 KHz
-- 850 - 1250 in 50 KHz
function ctld_c.generateVHFrequencies() -- DSMC modified to limit range

    ctld_c.freeVHFFrequencies = {}
    local _start = ctld_c.beaconMinFreq

    -- first range
    while _start < ctld_c.beaconMaxFreq do
        if ctld_c.isAvailableVHFFrequency( _start ) then
            table.insert(ctld_c.freeVHFFrequencies, _start)
        end
        _start = _start + 50000
    end
end

-- 220 - 399 MHZ, increments of 0.5MHZ
function ctld_c.generateUHFrequencies()

    ctld_c.freeUHFFrequencies = {}
    local _start = 220000000

    while _start < 399000000 do
        table.insert(ctld_c.freeUHFFrequencies, _start)
        _start = _start + 500000
    end
end


-- 220 - 399 MHZ, increments of 0.5MHZ
--    -- first digit 3-7MHz
--    -- second digit 0-5KHz
--    -- third digit 0-9
--    -- fourth digit 0 or 5
--    -- times by 10000
--
function ctld_c.generateFMFrequencies()

    ctld_c.freeFMFrequencies = {}
    local _start = 220000000

    while _start < 399000000 do

        _start = _start + 500000
    end

    for _first = 3, 7 do
        for _second = 0, 5 do
            for _third = 0, 9 do
                local _frequency = ((100 * _first) + (10 * _second) + _third) * 100000 --extra 0 because we didnt bother with 4th digit
                table.insert(ctld_c.freeFMFrequencies, _frequency)
            end
        end
    end
end

function ctld_c.getPositionString(_unit)

    if ctld_c.JTAC_location == false then
        return ""
    end

    local _lat, _lon = coord.LOtoLL(_unit:getPosition().p)

    local _latLngStr = ctld_c.tostringLL(_lat, _lon, 3, false)

    local _mgrsString = ctld_c.tostringMGRS(coord.LLtoMGRS(coord.LOtoLL(_unit:getPosition().p)), 5)

    return " @ " .. _latLngStr .. " - MGRS " .. _mgrsString
end


