-- looping removal function
function ctld_c.playerRemovalLoop()
    -- schedule
    timer.scheduleFunction(ctld_c.playerRemovalLoop, nil, timer.getTime() + 1)

    -- check
    for pName, pData in pairs(ctld_c.addedTo) do
        local check = false

        if pData and type(pData) == "table" then
            
            -- groun units check
            local tryId = tonumber(pName)
            if tryId and type(tryId) == "number" then
                check = true
            end

            -- name & life checks 
            if pData.unitName then
                local u = Unit.getByName(pData.unitName)
                if u then
                    if u:getLife() > 1 then
                        check = true
                    end
                end
            end

            if check == false then
                if debugProcessDetail then
                    env.info("DSMC playerRemovalLoop deleting " .. tostring(pName) .. ", unit name: " .. tostring(pData.unitName))
                end

                if pData.path and pData.groupId then

                    --if event.initiator:hasAttribute("Air") then
                        if debugProcessDetail then
                            env.info("DSMC playerRemovalLoop removing men√π entry from addedTo: " .. tostring(pName))
                        end
                        missionCommands.removeItemForGroup(pData.groupId, pData.path)
                    --end

                end

                -- remove from transportpilot
                for tId, tData in pairs (ctld_c.transportPilotNames) do 
                    if tData == pData.unitName then
                        tId = nil
                        if debugProcessDetail then
                            env.info("DSMC playerRemovalLoop deleted transportPilotNames entry")
                        end
                    end
                end
                        
                ctld_c.addedTo[pName] = nil
                --table.remove(ctld_c.addedTo, pName)
                if debugProcessDetail then
                    env.info("DSMC playerRemovalLoop deleted addedTo entry")
                end
            end
        end
    end
end
ctld_c.playerRemovalLoop()

