ctld_c.PlayerIsInside = {}
function ctld_c.PlayerIsInside:onEvent(event)	
	if event.id == world.event.S_EVENT_PLAYER_ENTER_UNIT and event.initiator then
		if Object.getCategory(event.initiator) == 1 then
			local unit 			= event.initiator
			if unit then
				local unitID = unit:getID()	
				local unitName = unit:getName()									
				if unit:hasAttribute("Helicopters") or unit:hasAttribute("APC") or unit:hasAttribute("IFV") or unit:hasAttribute("Trucks") then
                    local group = unit:getGroup()
                    if group then
                        local gId = group:getID()
                        if gId then
                            
                            local p = ctld_c.getPlayerNameOrType(unit)
                            local t = "Dear " .. tostring(p) .. ", the DSMC's version of ctld_c is active in this mission. To learn more about its features please go to the F10 Informations & signals menu and select the DSMC's ctld_c instruction option."
                            trigger.action.outTextForGroup(gId, t, ctld_c.displayMessageTime)



                        end
                    end
				end	
			end
		end
	end
end
