                        local unitsCoa = nil
						for units_id, units_data in pairs(group:getUnits()) do
							countTot = countTot + 1
							if units_data:hasAttribute("Infantry") then -- right?
								countInf = countInf +1
                                unitsCoa = units_data:getCoalition()
							end
						end
						
						if countInf == countTot and unitsCoa then
