								env.info("DSMC AddInfantriesOnBirth all units in the group are infantry")
							end

							local groupID = group:getID()
							local groupName = group:getName()
							local placefree = true
							if not ctld_c.extractableGroups[groupName] then
								table.insert(ctld_c.extractableGroups, groupName)

                                if unitsCoa == 1 then
                                    table.insert(ctld_c.droppedTroopsRED, groupName)
