ctld_c.playerLeave = {}
function ctld_c.playerLeave:onEvent(event)	
	if event.id == world.event.S_EVENT_PLAYER_LEAVE_UNIT or event.id == world.event.S_EVENT_DEAD or event.id ==  world.event.S_EVENT_CRASH then -- 18	
        if event.initiator then
            env.info("DSMC playerLeave event.initiator exist")
            if event.initiator:getCategory() == 1 then
                env.info("DSMC playerLeave event.initiator is a unit")
                local playerId = ctld_c.getPlayerNameOrUnitName(event.initiator)
                local unitName = Unit.getName(event.initiator)
                local _rootPath = nil
                if playerId then
                    env.info("DSMC playerLeave, playerId exist")
                    for aId, aData in pairs(ctld_c.addedTo) do
                        if aId == playerId then
                            _rootPath = aData.path
                        end
                    end
                    ctld_c.addedTo[playerId] = nil
                end
                

                if unitName and playerId and _rootPath then 
                    
                    ctld_c.transportPilotNames[unitName] = nil
                    env.info("DSMC playerLeave removing entry from transportPilotNames: " .. tostring(unitName))
                    local group = event.initiator:getGroup()
                    local groupId = group:getID()

                    if event.initiator:hasAttribute("Helicopters") and groupId then
                        env.info("DSMC playerLeave removing entry from addedTo: " .. tostring(playerId))
                        missionCommands.removeItemForGroup(groupId, _rootPath)
                        --env.info("DSMC playerLeave removing entry from missionCommand: " .. tostring(playerId))
                    end
                else
                    env.info("DSMC playerLeave missing parameters")
                end

            end
        end
	end
end
