function ctld_c.AddTroopsToVehicles(_unit, _numberOrTemplate)

    local _onboard = ctld_c.inTransitTroops[_unit:getName()]

    --number doesnt apply to vehicles
    if _numberOrTemplate == nil  or (type(_numberOrTemplate) ~= "table" and type(_numberOrTemplate) ~= "number")  then
        _numberOrTemplate = ctld_c.numberOfTroops
    end

    if _onboard == nil then
        _onboard = { troops = {}, vehicles = {} }
    end

	_onboard.troops = ctld_c.generateTroopTypes(_unit:getCoalition(), _numberOrTemplate, _unit:getCountry())
	
	--trigger.action.outTextForCoalition(_unit:getCoalition(), ctld_c.getPlayerNameOrType(_unit) .. " loaded troops into " .. _unit:getTypeName(), 10)
	ctld_c.processCallback({unit = _unit, onboard = _onboard.troops, action = "load_troops"})		
    ctld_c.inTransitTroops[_unit:getName()] = _onboard
end

