                                                                                    c = unitCoa
                                                                                else
                                                                                    c = 0
                                                                                end


                                                                                local tblPck = {unitName, "none", 10000, 1, c} -- changed for 1.2.3
                                                                                table.insert(ctld_c.pickupZones, tblPck)
                                                                                ctld_c.activatePickupZone(unitName)
                                                                                env.info("DSMC updatectld_cTables: warehouse added as pickupZone " .. tostring(unitName))
                                                                            end

                                                                        elseif _unit.category == "Fortifications" and _unit.type == "outpost" then           
                                                                            env.info("DSMC updatectld_cTables: checking FOB, found outpost object:" .. tostring(unitName))	
                                                                            local stObject = StaticObject.getByName(unitName)
                                                                            if stObject then																	
                                                                                local centerposUnit = stObject:getPosition().p
                                                                                if centerposUnit then
                                                                                    env.info("DSMC updatectld_cTables: checking FOB, outpost has position")
                                                                                    
                                                                                    local foundUnits = {}
                                                                                    local volS = {
                                                                                    id = world.VolumeType.SPHERE,
                                                                                    params = {
                                                                                        point = centerposUnit,
                                                                                        radius = 150
                                                                                    }
                                                                                    }
                                                                                    
                                                                                    local ifFound = function(foundItem, val)
                                                                                        env.info("DSMC updatectld_cTables: checking FOB, proximity object found")	                                                            
                                                                                        if foundItem:getTypeName() == "TACAN_beacon" then
                                                                                            env.info("DSMC updatectld_cTables: checking FOB, object is a beacon")	 
                                                                                            foundUnits[#foundUnits + 1] = foundItem:getName()
                                                                                            return true
                                                                                        end
                                                                                    end                                                           
                                                                                    world.searchObjects(Object.Category.UNIT, volS, ifFound)
                                                                                    
                                                                                    if table.getn(foundUnits) > 0 then -- there's a beacon nearby an outpost: it's a FOB                                                            
                                                                                        
                                                                                        --adding FOB
                                                                                        table.insert(ctld_c.logisticUnits, unitName)
                                                                                        env.info("DSMC updatectld_cTables: checking FOB, outpost added as FOB")	 
                                                                                        --if ctld_c.troopPickupAtFOB == true then
                                                                                        table.insert(ctld_c.builtFOBS, unitName)			
                                                                                        --end							
                                                                                        env.info("DSMC updatectld_cTables: unit " .. tostring(unitName) .. " is an outpost, ctld_c.logisticUnits updated")	                                                            
                                                                                        
                                                                                        --adding Beacon functionality
                                                                                        for fId, fData in pairs(foundUnits) do
                                                                                            --if fId == 1 then
                                                                                                local fObject = Unit.getByName(fData)
                                                                                                local fPoint = fObject:getPosition().p

                                                                                                if fPoint then
                                                                                                    --check proximity to FOB here
                                        
                                                                                                    local FOBname           = unitName
                                                                                                    ctld_c.beaconCount        = ctld_c.beaconCount + 1
                                                                                                    local _point            = {x = fPoint.x, y = fPoint.z}
                                                                                                    local _country          = StaticObject.getByName(unitName):getCountry()
                                                                                                    local _coalition        = StaticObject.getByName(unitName):getCoalition()
                                                                                                    local _radioBeaconName  = FOBname .. " beacon #" .. ctld_c.beaconCount                   
                                                                                                    
                                                                                                    local _freq = ctld_c.generateADFFrequencies()
                                        
                                                                                                    local _battery = -1                                                    
                                                                                                    local _lat, _lon = coord.LOtoLL(_point)
                                                                                                    local _latLngStr = ctld_c.tostringLL(_lat, _lon, 3, false)
                                                                                                    local _message = _radioBeaconName
                                                                                                    _message = _message .. " - " .. _latLngStr
                                                                                                    _message = string.format("%s - %.2f KHz", _message, _freq.vhf / 1000)
                                                                                                    --_message = string.format("%s - %.2f MHz", _message, _freq.uhf / 1000000)                                                        
                                                                                                    --_message = string.format("%s - %.2f MHz ", _message, _freq.fm / 1000000)                                                            
                                        
                                                                                                    local _beaconDetails = {
                                                                                                        vhf = _freq.vhf,
                                                                                                        vhfGroup = unitName,
                                                                                                        --uhf = _freq.uhf,
                                                                                                        --uhfGroup = unitName,
                                                                                                        --fm = _freq.fm,
                                                                                                        --fmGroup = unitName,
                                                                                                        text = _message,
                                                                                                        battery = _battery,
                                                                                                        coalition = _coalition,
                                                                                                    }
                                                                                                    ctld_c.updateRadioBeacon(_beaconDetails)
                                                                                                    table.insert(ctld_c.deployedRadioBeacons, _beaconDetails)                                           
                                                                                                    ctld_c.fobBeacons[unitName] = { vhf = _beaconDetails.vhf } -- , uhf = _beaconDetails.uhf , fm = _beaconDetails.fm
                                                                                                    env.info("DSMC updatectld_cTables: checking FOB, beacon added")	
                                                                                                end
                                                                                            --end
                                                                                        end
                                                                                    end
                                                                                end
                                                                            end
																			--[[
                                                                        elseif _unit.type == "Workshop A" then 
                                                                            env.info("DSMC updatectld_cTables: checking Factories, found Workshop A object:" .. tostring(unitName))	
                                                                            local stObject = StaticObject.getByName(unitName)
                                                                            if stObject then

                                                                                local pos = stObject:getPosition().p
                                                                                local coal = stObject:getCoalition()
                                                                                ctld_c.factoryObjects[unitName] = {vec3 = pos, coa = coal}

                                                                                --table.insert(ctld_c.factoryObjects, unitName)											
                                                                                env.info("DSMC updatectld_cTables: unit " .. tostring(unitName) .. " is a factory, ctld_c.factoryObjects updated")	
                                                                                ctld_c.factoryok[_coalitionName] = true
                                                                                
                                                                                --ctld_c.factoryok = true
                                                                                env.info("DSMC updatectld_cTables: factoryok " .. tostring(ctld_c.factoryok))	
                                                                            end
																			--]]--

                                                                        end
                                                                    --end
                                                                --end
                                                            end
                                                        end
                                                    --end
                                                end
                                            end
										end
									end
                                end	
                            elseif _objectTypeName == "ship" then   
								if ((type(_objectTypeData) == 'table')
										and _objectTypeData.group
										and (type(_objectTypeData.group) == 'table')
										and (#_objectTypeData.group > 0)) then
									for _groupId, _group in pairs(_objectTypeData.group) do
										if _group and _group.units and type(_group.units) == 'table' then								
											for _unitNum, _unit in pairs(_group.units) do
                                                --DICTPROBLEM
                                                --local unitName = env.getValueDictByKey(_unit.name)
                                                local unitName =_unit.name
                                                if unitName then                                
                                                    local uTbl = Unit.getByName(unitName)
                                                    if uTbl then
                                                        if uTbl:hasAttribute("Aircraft Carriers") then
                                                            table.insert(ctld_c.logisticUnits, unitName)
                                                            local tblPck = {unitName, "none", 20, "yes", 0}
                                                            table.insert(ctld_c.pickupZones, tblPck)
                                                            ctld_c.activatePickupZone(unitName)
                                                            env.info("DSMC updatectld_cTables: carrier added as logistic " .. tostring(unitName))
                                                        end
                                                    end
                                                end
                                            end
                                        end
                                    end
                                end
							end
						end
					end
				end
			end
		end
	end

    -- add zones code
	for zId, zData in pairs(env.mission.triggers.zones) do	
        if string.find(zData.name, ctld_c.forcePickzoneTag) then
            local t = { zData.name, "none", -1, "yes", 0 }
            table.insert(ctld_c.pickupZones, t)
            ctld_c.activatePickupZone(zData.name)
            if debugProcessDetail then
                env.info("DSMC updatectld_cTables: zone " .. tostring(zData.name) .. " has forcePickzoneTag in its name, ctld_c.pickupZones updated")
            end   
        elseif string.find(zData.name, ctld_c.forceDropzoneTag) then
            local t = { zData.name, "none", 0 }
            table.insert(ctld_c.dropOffZones, t)
            if debugProcessDetail then
                env.info("DSMC updatectld_cTables: zone " .. tostring(zData.name) .. " has forceDropzoneTag in its name, ctld_c.dropOffZones updated")
            end            
        elseif string.find(zData.name, ctld_c.forceWpzoneTag) then
            local t = { zData.name, "none","no", 0 }
            table.insert(ctld_c.wpZones, t)
            if debugProcessDetail then
                env.info("DSMC updatectld_cTables: zone " .. tostring(zData.name) .. " has forceWpzoneTag in its name, ctld_c.wpZones updated")
            end               
        end
    end
	env.info("DSMC updatectld_cTables done")
end

function ctld_c.updateLogisticTableWithAirport()
	local apt_Table = world.getAirbases()
	if apt_Table then
		for Aid, Adata in pairs(apt_Table) do
			local aptName = Adata:getName()	
			if debugProcessDetail then
				env.info("DSMC updateLogisticTables: checking " .. tostring(aptName))
			end
			local unitTbl = Unit.getByName(aptName)
			if unitTbl then
				if type(unitTbl) == 'table' then
					table.insert(ctld_c.logisticUnits, aptName)
					if debugProcessDetail then
						--trigger.action.outText("DSMC-ctld_c: " .. tostring(aptName) .. " airbase is a logistic site available for operations", 10)
						env.info("DSMC updateLogisticTables: " .. tostring(aptName) .. " airbase is a logistic unit")
					end				
				end
			end
		end
	end
end

ctld_c.updatectld_cTables()
