-- Sort out extractable groups
for _, _groupName in pairs(ctld_c.extractableGroups) do

    local _group = Group.getByName(_groupName)

    if _group ~= nil then

        if _group:getCoalition() == 1 then
            table.insert(ctld_c.droppedTroopsRED, _group:getName())
            env.info("DSMC added group to RED dropped: " .. tostring(_groupName))
        elseif _group:getCoalition() == 2 then
            table.insert(ctld_c.droppedTroopsBLUE, _group:getName())
            env.info("DSMC added group to BLUE dropped: " .. tostring(_groupName))
        else 
            table.insert(ctld_c.droppedTroopsNEUTRAL, _group:getName())
            env.info("DSMC added group to RED dropped: " .. tostring(_groupName))
        end
    end
end


-- create crate lookup table
for cCat, cTable in pairs(ctld_c.spawnableCrates) do 
    for _subCatData, scTable in pairs(cTable) do
        for _subSubCat, _crates in pairs(scTable) do
            for _, _crate in pairs(_crates) do
                -- convert number to string otherwise we'll have a pointless giant
                -- table. String means 'hashmap' so it will only contain the right number of elements
                ctld_c.crateLookupTable[tostring(_crate.weight)] = _crate
            end
        end
    end
end
